003e\u003cbr\u003eSe pueden realizar diversas operaciones sobre cada uno de los registros, haciendo click sobre el botÃÂ³n de la derecha.\u003cbr\u003e\u003cb\u003eModificar:\u003c/b\u003e\\r\\n permite modificar los datos del usuario y sus datos personales, desde \\r\\nesta opciÃÂ³n se puede cambiar la foto de perfil y realizar el cambio de \\r\\nla contraseÃÂ±a.\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpuseracciones.jpg\\\"\u003e\u003cbr\u003e\u003cbr\u003e\u003cbr\u003eSi hacemos click en \u003cb\u003emodificar\u003c/b\u003e datos personales accedemos a la opciÃÂ³n de actualizacion de datos\u003cbr\u003e\u003cbr\u003e\u003cb\u003eDatos generales:\u003c/b\u003e corresponde a los datos del usuario de sistema.\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpusersedit.jpg\\\"\u003e\u003cbr\u003e\u003cbr\u003e\u003cb\u003eFoto del perfil:\u003c/b\u003e se puede cambiar la imagen de perfil la imagen debe ser menor a 1 MB.\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpfotoperfil.jpg\\\"\u003e\u003cbr\u003e\u003cb\u003eModificar\\r\\n ContraseÃÂ±a: \u003c/b\u003epermite modificar la contraseÃÂ±a del usuario, la misma debe \\r\\ncontener letras y nÃÂºmero y estar en el rango de Buena a Fuerte, se \\r\\nvisualiza la leyenda a medida que la escribimos.\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpusereditpswd.jpg\\\"\u003e\u003cbr\u003e\u003cbr\u003e\u003cb\u003eBorrar:\u003c/b\u003e permite realizar el borrado del usuario seleccionado siempre y cuando el mismo no tenga asociado ventas, u bicicletas.\u003cbr\u003e\u003cb\u003eAgregar Bicicleta:\u003c/b\u003e permite asociar bicicletas al usuario\u003cbr\u003e\\r\\n\t\t\t\t\u003cp\u003e\\r\\n\t\t\t\t\t\u003c/p\u003e\u003cp\u003e\\r\\n\t\t\t\t\u003c/p\u003e'),(2,'users','addcliente','\u003ch2\u003eUsuarios/Agregar\\r\\n\t\t\t\u003c/h2\u003e\\r\\n\t\t\t\\r\\n\t\t\t\tPermite realizar el alta de un nuevo usuario al sistema los usuarios\\r\\n por defecto son clientes, de esta manera el cliente recive un mail de \\r\\nconfirmaciÃÂ³n de alta de usuario para poder operar luego en el sistema \\r\\nsobre las opciones propias del cliente como ver sus bicicletas, ver \\r\\nhistorial de reparaciones, cambiar sus datos etc.\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpusersdd.jpg\\\"\u003e\u003cbr\u003e'),(3,'tallercitos','edit','Mi Taller/Ver Datos\u003cbr\u003e\u003cbr\u003ePermite ver u actualizar los datos del taller, es importante que el domicilio este correctamente ingresado de manera que cuando se requiera servicios de ubicaciÃÂ³n pueda encontrarse con exactitud el domicilio del local.\u003cbr\u003e\u003cb\u003eLogo de Taller\u003c/b\u003e: permite seleccionar una imagen para el logo del taller que si visualiza luego en la parte superior izquierda.\u003cbr\u003e \u003cb\u003eShimano Center\u003c/b\u003e \u003cb\u003eOficial\u003c/b\u003e: Si seleccionamos en si la opciÃÂ³n el cliente cuando accede a la aplicaciÃÂ³n visualiza el cartel de Shimano Service Center Oficial.\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hptallercitosinfo.jpg\\\"\u003e\\r\\n \t\t\t\t\u003cp\u003e\\r\\n \t\t\t\t\t\u003c/p\u003e\u003cp\u003e\\r\\n \t\t\t\t\u003c/p\u003e'),(4,'bicicletas','index','\u003ch2\u003eBicicletas Agregar\u003c/h2\u003e\u003cp\u003ePermite asociar bicicletas al cliente del sistema.\u003c/p\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hbbicicletasindex.jpg\\\"\u003e\u003cbr\u003eSi hacemos click en agregar podemos agregar una nueva bicicleta. Se puede capturar una foto por medio de una web cam u por medio de un archivo del sistema.\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpbicicletasadd.jpg\\\"\u003e\u003cbr\u003e\u003cbr\u003e'),(5,'bicicletareparamos','bicicletareparamocalendario','\u003ch2\u003eMi Taller/Ver Calendario\\r\\n\t\t\t\u003c/h2\u003e\\r\\n\t\t\t\\r\\n\t\t\t\tPermite visualizar el calendario de repaciÃÂ³n de las bicicletas que se encuentran\\r\\n para mantenimiento, nos muestra una linea de tiempo con color \\r\\ndependiendo el estado que se encuentren. \u003cbr\u003e\u003cb\u003eNOTA:\u003c/b\u003e La fecha desde es la fecha en que ingresa la bicicleta.\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hptallercalendario.jpg\\\"\u003e\\r\\n\t\t\t\t'),(6,'bicicletareparamos','vertotalservicemes','\u003ch2\u003eMi Taller/Ingresos Mensuales\\r\\n\t\t\t\u003c/h2\u003e\\r\\n\t\t\t\\r\\n\t\t\t\tPermite ver un grÃÂ¡fico con los montos de los ingresos mensuales proveniente de services realizados en el taller. Se debe ingresar el aÃÂ±o que queremos visualizar para traer los resultados por meses del aÃÂ±o.\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpingresosmens.jpg\\\"\u003e\\r\\n\t\t\t\t\u003cp\u003e\\r\\n\t\t\t\t\t\u003c/p\u003e\u003cp\u003e\\r\\n\t\t\t\t\u003c/p\u003e'),(7,'bicicletareparamos','tiemposreparestimado','\u003ch2\u003eMi Taller/Tiempos Estimados\\r\\n\t\t\t\u003c/h2\u003e\\r\\n\t\t\t\u003cp\u003e\\r\\n\t\t\t\tPosee una serie de filtros que nos permite buscar por rango de fecha\\r\\nlas cuales son obligatorias, mas una descripiÃÂ³n que es optativa, al ejecutar la \\r\\nconsulta haciendo clic en buscar nos muestra los sevice y el tiempo \\r\\nestimado que llevo realizar los arreglos resultante de los filtros seleccionados.\u003c/p\u003e\u003cb\u003eNOTA: \u003c/b\u003een (Detalle ReparaciÃÂ³n) podemo escribir cualquier detalle respecto a como cargamos el campo libre en el ingreso de bicicletas.\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hptiempoestimado.jpg\\\"\u003e\\r\\n\t\t\t\\r\\n\t\t\t\u003cp\u003e\\r\\n\t\t\t\t\u003c/p\u003e\u003cp\u003e\\r\\n\t\t\t\u003c/p\u003e'),(8,'mensajes','indexmant','\u003ch2\u003eMi Taller/Mensajes de Mantenimiento\\r\\n\t\t\t\u003c/h2\u003e\\r\\n\t\t\t\\r\\n\t\t\t\tEsta opciÃÂ³n posee una serie de filtros que nos permite buscar por rango de fecha las mismas son obligatorias mas una descripiÃÂ³n que es optativa, al ejecutar la \\r\\nconsulta haciendo clic en Mostrar nos devuelve todos los mensajes de \\r\\nmantenimiento enviados u por enviar, permitiendo realizar operaciones de\\r\\n borrado u modificar el mensaje cargado.\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpmensajesmant.jpg\\\"\u003e\\r\\n\t\t\t\\r\\n\t\t\t\u003cp\u003e\\r\\n\t\t\t\t\u003c/p\u003e\u003cp\u003e\\r\\n\t\t\t\u003c/p\u003e'),(9,'bicicletareparamos','add','\u003ch2\u003eBicicletas/Nuevo ingreso\\r\\n\t\t\t\u003c/h2\u003e\\r\\n\t\t\t\\r\\n\t\t\t\tPermite realizar el ingreso de una bicicleta al taller, para realizar el alta son necesarias las siguientes condiciones:\u003cbr\u003eSe debe seleccionar un cliente desde la opciÃÂ³n de bÃÂºsqueda al lado del documento.\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpbuscarcliente.jpg\\\"\u003eSeleccionamos el cliente requerido haciendo clic en la imagen\u0026nbsp;\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpagregar.jpg\\\"\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpselcliente.jpg\\\"\u003e\u003cbr\u003e\u003cbr\u003eSeleccionar la bicicleta a reparar, el cliente debe tener asociada la bicicleta.\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpseleccionarbicicleta.jpg\\\"\u003e\u003cbr\u003e\u003cbr\u003eIngresar uno u n gastos.\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hbbicicletasnuevoingreso.jpg\\\"\u003e\u003cbr\u003e\u003cbr\u003eEn\\r\\n el caso de quedarnos sin filas haciendo click en el boton (+) se agrega\\r\\n una nueva fila. Debe ingresar la cantidad y el precio unitario.\u003cbr\u003eMarca envia domicilio: determina si la bicicleta debe ser llevada al domicilio del cliente.\u003cbr\u003ePara buscar un producto hacemos click en la lupa verde a la izquierda de la grilla la cual nos muestra una ventana con los distintos filtros de bÃÂºqueda para productos permitiendonos buscar para luego agregar el producto que buscamos.\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpseleccionarproducto.jpg\\\"\u003e\u003cbr\u003ePara eliminar una fila de los gastos hacemos click sobre el botÃÂ³n derecho\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpborrar.jpg\\\"\u003e\u003cbr\u003e\u003cbr\u003e\\r\\n\t\t\t\\r\\n\t\t\t\u003cp\u003e\\r\\n\t\t\t\t\u003c/p\u003e\u003cp\u003e\\r\\n\t\t\t\u003c/p\u003e'),(10,'bicicletareparamos','index','\u003ch2\u003eBicicletas/Ver Ingresos\\r\\n\t\t\t\u003c/h2\u003e\\r\\n\t\t\t\\r\\n\t\t\t\tPermite ver y realizar operaciones sobre los registros de ingresos \\r\\nde bicicletas al taller, los filtros nos permiten buscar una bicicleta a\\r\\n partir de los datos del cliente pueden ser el documento u nombre u \\r\\napellido, los filtros son opcionales.\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpveringresos.jpg\\\"\u003e\u003cbr\u003e\u003cp\u003e\u003cbr\u003e\u003c/p\u003e\u003cp\u003e\u003cb\u003eAcciones:\u003c/b\u003e permite realizar diversas operaciones sobre los registros.\u003c/p\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpmenuingreso.jpg\\\"\u003e\u003cbr\u003e\u003cul\u003e\u003cli\u003e\u003cb\u003eBorrar:\u003c/b\u003e borra el ingreso del sistema.\u003c/li\u003e\u003cli\u003e\u003cb\u003eModificar:\u003c/b\u003e permite modificar u agregar nuevos gastos.\u003c/li\u003e\u003cli\u003e\u003cb\u003eImprimir:\u003c/b\u003e\\r\\n retorna un PDF con un cÃÂ³digo QR y detalles del arreglo el cual puede \\r\\nservir para imprimir y pegarlo en la bicicleta de manera que luego al \\r\\nescanear la etiqueta con un celular nos lleva a los detalle de \\r\\nreparaciÃÂ³n de la bicicleta.\u003c/li\u003e\u003c/ul\u003e'),(11,'bicicletareparamos','tallerlistarbicicletas','\u003ch2\u003eBicicletas/Ver Bicicletas en Taller\\r\\n\t\t\t\u003c/h2\u003e\\r\\n\t\t\t\\r\\n\t\t\t\tPermite visualizar y modificar el estado de la bicicleta en el \\r\\ntaller, desde esta opciÃÂ³n podemos cambiar el estado en que se encuentra \\r\\nla bicicleta en el taller los estado posibles on\u003cbr\u003e\u003cul\u003e\u003cli\u003e\u003cb\u003eEspera:\u003c/b\u003e en espera para ingresar al taller\u003c/li\u003e\u003cli\u003e\u003cb\u003eEn Taller:\u003c/b\u003e se encuentra en proceso de reparaciÃÂ³n en el taller.\u003c/li\u003e\u003cli\u003e\u003cb\u003eConfirmar\\r\\n Cliente:\u003c/b\u003e al seleccionar este estado el sistema despliega una ventana \\r\\nemergente en la cual podemos enviar un mensaje al cliente para que este \\r\\nsepa la novedad y puede por medio de sus opciones confirmar el mensaje \\r\\npara que siga en curso la reparaciÃÂ³n u contactarse con el encargado del \\r\\ntaller.\u003c/li\u003e\u003c/ul\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpingresostaller.jpg\\\"\u003e\u003cbr\u003e\u003cbr\u003e\u003cp\u003eUna\\r\\n ves enviado el mensaje debemos esperar en confirmar del cliente para \\r\\npoder seguir operando cuando el mismo confirma la imagen de mensajes \\r\\ndebe estar en 0 y en verde, si falta confirmar el mensaje aparece la \\r\\ncantidad de mensajes a confirmar con rojo\u003c/p\u003e\u003cbr\u003eVentana de enviÃÂ³ de mensajes.\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hhmensajeservtec.jpg\\\"\u003e\u003cbr\u003e\u003cb\u003eArreglo\\r\\n finalizado: \u003c/b\u003eeste estado nos indica que se\u003cb\u003e \u003c/b\u003efinalizo el arreglo de la bicicleta, por lo tanto se encuentra lista \\r\\npara ser retirada, al seleccionar este estado desaparece de esta opciÃÂ³n el registro y se debe \\r\\ncontinuar la entrega por otro circuito.\u003cbr\u003e\u003cbr\u003e\u003cb\u003eAcciones:\u003c/b\u003e se puede modificar el pedido de reparaciÃÂ³n u imprimir para enviar la impresiÃÂ³n un reporte con lo que se debe realizar para enviar esta impresiÃÂ³n al taller de ser necesario.\u003cbr\u003e\u003cbr\u003e'),(12,'bicicletareparamos','bicicletasentrega','\u003ch2\u003eBicicletas/Entregar Bicicleta\\r\\n\t\t\t\u003c/h2\u003e\\r\\n\t\t\t\\r\\n\t\t\t\tPermite realizar las operaciones de entrega de la bicicleta, podemos\\r\\n buscar la bicicleta a partir de los datos del cliente como ser \\r\\ndocumento nombre u apellido los filtros son opcionales.\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpentregabicicleta.jpg\\\"\u003e\u003cbr\u003e\u003cbr\u003eAl\\r\\n marcar el registro como entregado se despliega una ventana para \\r\\nrealizar el pago del arreglo que consta de opciones de pago \\r\\nde contado,Credito u tarjeta, una ves que aceptamos el pago el registro \\r\\nqueda marcado como entregado en \\\"si\\\". Una vez confirmado no serÃÂ¡ posible\\r\\n volver a realizar el pago,\u003cbr\u003e\u003cbr\u003ePodemos imprimir un ticker desde la opciÃÂ³n de acciones\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpimprimir.jpg\\\"\u003e\u003cbr\u003e\u003cbr\u003ePodemos agregar mensajes de mantenimiento para la bicicleta desde la imagen de sobre de correo, llegado el \\r\\ndÃÂ­a en que asignamos como fecha de enviÃÂ³, el mensaje se envÃÂ­a automaticamente al mail\\r\\n del cliente. El mismo tambiÃÂ©n puede operar desde sus opciones y ver el mensaje.\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpmensaje.jpg\\\"\u003e\u003cbr\u003eAl asignar mensajes de mantenimiento se\\r\\n visualizara la ventana para cargar mensajes de mantenimiento, la fecha \\r\\nde envÃÂ­o debe ser mayor a la fecha actual, el asunto el motivo del \\r\\ncontrol y el detalle lo que querramos informar al cliente\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpmensajeservtec.jpg\\\"\u003e\u003cbr\u003e'),(13,'bicicletareparamos','mapbicicletaentregaall','\u003ch2\u003eBicicletas/Entregas Vista GPS\\r\\n\t\t\t\u003c/h2\u003e\\r\\n\t\t\t\\r\\n\t\t\t\tNos muestra un mapa con los diversos lugares dÃÂ³nde debemos dejar las bicicletas.\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hbentregagps.jpg\\\"\u003e\u003cbr\u003eSi queremos ver los datos del cliente hacemos click en \u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpdomentrega.jpg\\\"\u003e para ver en detalles los clientes y el domicilio\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpdomentregalist.jpg\\\"\u003e \u003cbr\u003eEs\\r\\n posible cambiar las coordenadas de referencia de entrega si desplegamos\\r\\n Domiclios de Entrega y hacemos click en el ÃÂ­cono de punto GPS \u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpgpspos.jpg\\\"\u003e se abre una nueva ventana para que podemos referenciar las coordenadas exactas de entrega.\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpcambiarcoorentrega.jpg\\\"\u003e\u003cbr\u003e\u003cbr\u003eEsta ventana posee en la parte superior los datos del cliente con la ÃÂºltima referencia de Latitud y Longitud asginada.\u003cbr\u003eEn\\r\\n el cuadro se puede ingresar manualmente un direcciÃÂ³n en el formato \\r\\npropuesto al hacer click en el mapa nos ubica en esa regiÃÂ³n u domicilio.\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpcoorautomatica.jpg\\\"\u003e\u003cbr\u003eEjemplo\\r\\n agregamos los datos y hacemos click en el botÃÂ³n para situarnos en ese \\r\\nlugar del planeta, si hacemos click veremos que aparece una marca y \\r\\ncambian las coordenadas si cambiamos esta y hacemos click la nueva \\r\\ncoordenada serÃÂ¡ guardada.\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpbusquedacoord.jpg\\\"\u003e\u003cbr\u003eAsignaciÃÂ³n de coordenada al hacer click sobre el mapa se agrega un indicador dÃÂ³nde realizamos click con el mouse y se actualizan las coordenadas visualizadas en la pantalla como Latitud y Longitud:\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpcoormapa.jpg\\\"\u003e \\r\\n\t\t\t'),(14,'clientes','clientedeuda','\u003ch2\u003eMovimientos/Cliente Deuda\u003c/h2\u003e\u003cp\u003eNos permite visualizar las deudas de los clientes, podemos realizar el filtrado por los datos del cliente u traer todos los clientes con sus respectiva deuda.\u003c/p\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpclientedeuda.jpg\\\"\u003e'),(15,'movimientos','veringresosfecha','\u003ch2\u003eMovimientos/Movimiento por Fecha.\u003c/h2\u003ePermite visualizar los movimientos realizados en el sistema. \u003cbr\u003eEntre los filtros es oblogatoria la fecha desde y hasta.\u0026nbsp; \u003cbr\u003eEl tipo de movimiento que pueden ser todos. \u003cbr\u003e\u003cli\u003ePodemos ver todos los movimientos realizados para un cliente en particular.\u003c/li\u003e\u003cp\u003e\u003cb\u003eNOTA:\u003c/b\u003e antes del listado general se visualiza los diversos tipos de movimientos y sus totales repectivo.\u003c/p\u003e\u003cp\u003e\u003cb\u003eNOTA:\u003c/b\u003e entre las acciones se puede eliminar un movimiento es importante tener mucho cuidado con el borrado de lo contrario puede traer problemas en los balances del sistema.\u003c/p\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpmovimientos.jpg\\\"\u003e'),(16,'movimientos','movimientosmanuales','\u003ch2\u003eMovimientos/Movimientos Manuales\u003c/h2\u003ePermite realizar transacciones de distinto tipo como ser Egresos Varios, Ingresos Varios etc.\u003cbr\u003eEs importante tener mucho cuidado con el uso de movimiento Gral ya que se pueden ingresar movimientos por importes y valores determinados por el usuario, es importante saber lo que se hace de lo contrario requerir mas informaciÃÂ³n.\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpmovimientosmanuales.jpg\\\"\u003e\u003cbr\u003e\u003cbr\u003ePara realizar el pago de cuenta corriente selecciona la opciÃÂ³n de \u003cb\u003eCuenta Corriente\u003c/b\u003e\u003cbr\u003eSe debe selecionar el cliente que queremos realizar el pago de Cta Cte y luego agregar el monto que paga.\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpmovimientoctacte.jpg\\\"\u003e\u003cbr\u003e'),(17,'accesorapidos','index','\u003ch2\u003eVentana Inicial\u003c/h2\u003e\u003cp\u003eLa ventana principal nos muestra una pantalla que contiene en la parte superior un grupo de botones u accesos rÃÂ¡pidos a opciones del sistema que pueden ser requeridas constantemente, estas opciones pueden ser agregadas u sacadas habilitando u deshabilitando las mismas desde la opciÃÂ³n \u003cb\u003eSistema/Activar Accesos\u003c/b\u003e\u003c/p\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hcbotonesacceso.jpg\\\"\u003e\u003cp\u003eLuego se presenta una serie de cuadros con informaciÃÂ³n visual respecto a las bicicletas y sus estados en el taller, en esta captura podemos ver que en espera tenemos 0 bicicletas y en Espera ConfirmaciÃÂ³n hay 4 bicicletas.\u003c/p\u003e\u003cul\u003e\u003cli\u003e\u003cb\u003eEn espera:\u003c/b\u003e bicicleta que no ingresaron al taller.\u003c/li\u003e\u003cli\u003e\u003cb\u003eEn taller:\u003c/b\u003e bicicletas que se encuentra en taller.\u003c/li\u003e\u003cli\u003e\u003cb\u003eEspera ConfirmaciÃÂ³n:\u003c/b\u003e bicicletas que se le envÃÂ­o un mensaje al cliente y se espera una confirmaciÃÂ³n u se requiere que se contacte el cliente.\u003c/li\u003e\u003cb\u003eMensajes de Mantenimiento:\u003c/b\u003e mensajes que deben ser enviado en la fecha a los distintos clientes podemos consultarlo y hablar al cliente de ser necesario para recordar la novedad.\u003cbr\u003e\u003c/ul\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hpmensajesaccesorapido.jpg\\\"\u003eSi hacemos click en \u003cb\u003eVer Detalle \u003c/b\u003ede cualquiera de las cajas veremos informaciÃÂ³n despecto a las bicicletas como se muestra a continuaciÃÂ³n veremos las del combo de \u003cb\u003eEspera ConfirmaciÃÂ³n\u003c/b\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hcesperaconfirmacion.jpg\\\"\u003e\u003cbr\u003e\u003cp\u003eEsta caja nos muestra la fecha de ingreso la bicicleta Marca Modelo si queremos ver mas detalle hacemos click sobre el enlace para ver los detalles de la bicicleta incluida la foto si la tuviera asociada.\u003c/p\u003e\u003cp\u003eSi deseamos modificar algo respecto al pedido hacemos click en la imagen\u003c/p\u003e\u003cp\u003e\u003cimg style=\\\"max-width:890px\\\"  src=\\\"/img/help/hcbotonmodificar.jpg\\\"\u003e\u003c/p\u003e\u003cp\u003ePara asÃÂ­ acceder a la ediciÃÂ³n del ingreso de la bicicleta.\u003c/p\u003e\u003cbr\u003e'),(18,'categorias','index','\u003ch2\u003eProductos Categorias\u003c/h2\u003ePermite visualizar y administrar las diversas categorias y subcategorias para los diversos productos. \u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpcategorias.jpg\\\"\u003e\u003cbr\u003e\u003cbr\u003eSi hacemos click sobre el detalle de la categorÃÂ­a podemos ver las subcategorias asociadas.\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpversubcateg.jpg\\\"\u003e\u003cbr\u003ePara administrar la mismas hacemos click en el botÃÂ³n de acciones posibles sobre el registro para las subcategorias solo podemos editar u eliminar solo si no se encuentra asociada a ningÃÂºn producto.\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hbfuncsubcateg.jpg\\\"\u003e\u003cbr\u003e\u003cbr\u003eSi hacemos click en el botÃÂ³n de acciones sobre una categoria nos permite modificar, borrar solo si no se encuentra asociada a ningÃÂºn producto u agregar una nueva subcategoria en Agregar Subcategoria.\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hbcategoriaaddsub.jpg\\\"\u003e\u003cbr\u003e\u003cbr\u003ePara crear una categoria hacemos click en el boton de la parte inferior Agregar.\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hbcategagrega.jpg\\\"\u003e\u003cbr\u003e\u003cp\u003e\u003cdiv id=\\\"__zsc_once\\\"\u003e\u003c/div\u003e\u003c/p\u003e'),(19,'categorias','add','\u003ch2\u003eAgregar Categoria.\u003c/h2\u003e\u003cp\u003ePermite realizar el alta de una nueva categoria. Se debe ingresar la categorÃÂ­a y una imagen desde un archivo determinado al seleccionar la imagen se visualiza en el area de color amarillo para no equivocarnos en la imagen cargada.\u003c/p\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpcategoriasadd.jpg\\\"\u003e\u003cp\u003e\u003cdiv id=\\\"__zsc_once\\\"\u003e\u003c/div\u003e\u003c/p\u003e'),(20,'categorias','addsub','\u003ch2\u003eAgregar Subcategorias\u003c/h2\u003e\u003cp\u003ePermite agregar una u n subcategorias para la categoria selecionada, es posible asociarle la imagen para la subcategoria desde un archivo desde el PC del usuario.\u003c/p\u003e\u003cp\u003e\u003cb\u003eSi queremos agregar nuevas filas acemos click en\u003c/b\u003e \u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpagregar.jpg\\\"\u003e\u003c/p\u003e\u003cb\u003eSi queremos eliminar la fila hacemos click en\u003c/b\u003e \u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpborrar.jpg\\\"\u003e\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpsubcategoria.jpg\\\"\u003e\u003cp\u003e\u003cdiv id=\\\"__zsc_once\\\"\u003e\u003c/div\u003e\u003c/p\u003e'),(21,'categorias','edit','\u003ch2\u003eActualizar Categoria/Subcategoria\u003c/h2\u003e\u003cp\u003ePermite modificar los datos de la \u003cb\u003ecategoria/subcategoria\u003c/b\u003e cargados, se puede modificar la descripciÃÂ³n asÃÂ­ como la imagen.\u003c/p\u003e\u003cp\u003eLa imagen actual se visualiza a la derecha de la pantalla, si asignamos una nueva imagen esta imagen cambiarÃÂ¡ por la nueva imagen seleccionada.\u003c/p\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hccategoriaedit.jpg\\\"\u003e\u003cp\u003e\u003cdiv id=\\\"__zsc_once\\\"\u003e\u003c/div\u003e\u003c/p\u003e'),(22,'proveedores','index','\u003ch2\u003eProveedores\u003c/h2\u003e\u003cp\u003ePermite visualizar y realizar Alta/Baja u ModificaciÃÂ³n de los proveedores, que luego van ser vinculados a los diversos productos.\u003c/p\u003e\u003cp\u003ePara agregar un nuevo proveedore hacemos click en el botÃÂ³n agregar.\u003c/p\u003eCon el botÃÂ³n de acciones accedemos a las operaciones de modificaciÃÂ³n u borrado del proveedor.\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hcproveedoresindex.jpg\\\"\u003e\u003cbr\u003e\u003cp\u003e\u003cdiv id=\\\"__zsc_once\\\"\u003e\u003c/div\u003e\u003c/p\u003e'),(23,'proveedores','add','\u003ch2\u003eAgregar Proveedor\u003c/h2\u003e\u003cp\u003ePermite ralizar el alta de un nuevo proveedor. Los datos son todos obligatorios para realizar el alta.\u003c/p\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpproveedoradd.jpg\\\"\u003e\u003cbr\u003e\u003cbr\u003e\u003cp\u003e\u003cdiv id=\\\"__zsc_once\\\"\u003e\u003c/div\u003e\u003c/p\u003e'),(24,'products','index','\u003ch2\u003eProducto\u003c/h2\u003ePermite visualizar la lista de productos cargada. Se posee una serie de filtros optativos para la bÃÂºsqueda del producto.\u003cbr\u003eEntre las acciones posibles para el registro del producto se encuentran:\u003cbr\u003e\u003cb\u003eModificar:\u003c/b\u003e permite modificar los datos cargado del producto.\u003cbr\u003e\u003cb\u003eBorrar:\u003c/b\u003e permite eliminar el producto solo si el mismo no se encuentra asignado en una venta.\u003cbr\u003e\u003cb\u003eFotos:\u003c/b\u003e podemos asignar una u n fotos para el producto seleccionado.\u003cbr\u003e\u003cbr\u003e\u003cb\u003eNOTA:\u003c/b\u003e los productos que tienen imagenes cargadas figuran con un pequeÃÂ±o ÃÂ­cono de imagen en la parte izquierda al lado del nombre del producto.\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpproductos.jpg\\\"\u003e\u003cbr\u003e\u003cp\u003e\u003c/p\u003e\u003cp\u003e\u003cdiv id=\\\"__zsc_once\\\"\u003e\u003c/div\u003e\u003c/p\u003e\u003cp\u003e\u003c/p\u003e'),(25,'products','add','\u003ch2\u003eAgregar Producto\u003c/h2\u003e\u003cp\u003ePermite realizar el alta de un nuevo producto.\u003c/p\u003e\u003cp\u003eNombre de Producto: nombre del producto a dar de alta.\u003c/p\u003e\u003cp\u003e\u003cb\u003eSintetico:\u003c/b\u003e un nombre sintetico para el producto puede ser una covinaciÃÂ³n de partes del nombre del producto queda a criterio del cliente.\u003c/p\u003e\u003cp\u003e\u003cb\u003eCod. Barras:\u003c/b\u003e cÃÂ³digo de barras si llegara a tenerlo de lo contrario lo dejamos libre.\u003c/p\u003e\u003cp\u003e\u003cb\u003eCategoria:\u003c/b\u003e la categoria del producto que queremos dar de alta.\u003c/p\u003e\u003cp\u003e\u003cb\u003eSubcategoria:\u003c/b\u003e es opcional no es obligatorio seleccionar la subcategoria.\u003c/p\u003e\u003cp\u003e\u003cb\u003eDetalles del Producto:\u003c/b\u003e es informaciÃÂ³n detalle del producto que es visualizada por el cliente u el usuario que realiza la venta.\u003c/p\u003e\u003cp\u003e\u003cb\u003eProveedor:\u003c/b\u003e el proveedor del producto, si escribimos una parte del nombre el sistema nos muestra la lista que coinciden con lo que vamos escribiendo.\u003c/p\u003e\u003cp\u003e\u003cb\u003ePrecio:\u003c/b\u003e el precio del producto.\u003c/p\u003e\u003cp\u003e\u003cb\u003eCÃÂ³digo Generico: \u003c/b\u003eun cÃÂ³digo que consta de 3 letras y 3 nÃÂºmero queda a opciÃÂ³n del usuario como ingresarlo.\u003c/p\u003e\u003cp\u003e\u003cb\u003ePeso: \u003c/b\u003eel peso en gramos del producto.\u003c/p\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hbproductsadd.jpg\\\"\u003e\u003cbr\u003e\u003cp\u003e\u003cdiv id=\\\"__zsc_once\\\"\u003e\u003c/div\u003e\u003c/p\u003e'),(26,'products','actualizapreciomasivo','\u003ch2\u003eActualizar Precios\\r\\n\u003c/h2\u003e\u003cp\u003eEsta opciÃÂ³n permite actualizar los precios de los productos de forma masiva. Para ello primero debemos seleccionar los filtros, es posible actualizar todos los precios de una sola ves, por lo tanto hay que tener cuidado a la hora de utilizar esta opciÃÂ³n.\u003c/p\u003e\u003cp\u003eEntre los filtros que son optativos tenemos la Categoria y SubcategorÃÂ­a.\u003c/p\u003e\u003cp\u003eEl porcentaje de actualizaciÃÂ³n es obligatorio y va desde 1 al 100.\u003c/p\u003e\u003cp\u003eOperaciÃÂ³n: permite determinar si incrementamos u decrementamos el precios.\u003c/p\u003e\u003cp\u003eUna ves asignados los diversos filtros hacemos click en Calcular, el cual nos muestra un listado con los productos a actualizar el precio actual y el nuevo precio con posbilidad de modificar en el caso que queramos redondear el importe.\u003c/p\u003e\u003cp\u003e\u003cb\u003eAct:\u003c/b\u003e determina si se actualizarÃÂ¡ u no el importe del producto.\u003c/p\u003e\u003cb\u003eUlt. Act:\u003c/b\u003e fecha de ÃÂºltima actualizaciÃÂ³n del producto.\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpproductprecio.jpg\\\"\u003e\u003cp\u003e\u003cdiv id=\\\"__zsc_once\\\"\u003e\u003c/div\u003e\u003c/p\u003e\u003cbr\u003eSi no queremos que actualize un determinado producto con destildarlo de la lista el mismo no serÃÂ¡ tenido en cuenta al actualizar.\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hbproductspreciono.jpg\\\"\u003e\u003cbr\u003e\u003cbr\u003eUna ves que chequemos los productos y determinamos si todo esta correcto solo debemos hacer click en el botÃÂ³n que aparece en la parte inferior del listado para que se ejecute el proceso de actualizaciÃÂ³n, finalizado el mismo nos mostrara un listado con los productos actualizados.\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpproductsactprec.jpg\\\"\u003e\u003cbr\u003e\u003cbr\u003eResultado de ejecuciÃÂ³n\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpproductprecsincam.jpg\\\"\u003e\u003cbr\u003e\u003cbr\u003e'),(27,'mensajes','index','\u003ch2\u003eMensajes\u003c/h2\u003e\u003cp\u003ePermite visualizar la trazabilidad completa de todos los mensajes que se enviaron en el sistema.\u003c/p\u003e\u003cp\u003eSe puede realizar la busqueda de las personas que enviamos mensajes u la fecha en la que se enviaron.\u003c/p\u003e\u003cp\u003eEn los resultados podemos ver:\u003c/p\u003e\u003cul\u003e\u003cli\u003e\u003cb\u003eCreado:\u003c/b\u003e fecha de creaciÃÂ³n del mensaje.\u003c/li\u003e\u003cli\u003e\u003cb\u003eEnviado:\u003c/b\u003e la fecha de enviÃÂ³ efectiva del mensaje.\u003c/li\u003e\u003cli\u003e\u003cb\u003eFecha Env. Auto:\u003c/b\u003e la fecha en la cual el mensaje se debe enviar de forma automÃÂ¡tica.\u003c/li\u003e\u003cli\u003e\u003cb\u003eTipo de Mensaje:\u003c/b\u003e el tipo de mensaje, pueden ser de usuario,taller u sistema.\u003c/li\u003e\u003cli\u003e\u003cb\u003eConfirmado:\u003c/b\u003e solo se confirman aquellos mensajes que se enviaron desde el taller.\u003c/li\u003e\u003c/ul\u003e\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpmensajes.jpg\\\"\u003e\u003cbr\u003e\u003cbr\u003eEntre las acciones del registro se pueden realizar la siguientes operaciones:\u003cbr\u003e\u003cb\u003eModificar:\u003c/b\u003e modificar el mensaje como ser la fecha de envÃÂ­o el Asunto u el detalle.\u003cbr\u003e\u003cb\u003eEliminar:\u003c/b\u003e permite eliminar el mensaje de la base de datos, cancelando de esta manera el envÃÂ­o del mensaje si es que hubiera tenido activado el enviÃÂ³ automÃÂ¡tico.\u003cbr\u003e\u003cb\u003eEnviar Mensaje:\u003c/b\u003e envÃÂ­a el mensaje de forma manual, cuando