003eTransacciones del Sistema\u003c/h2\u003e\u003cp\u003eEl sistema cuenta con un grupo de transacciones predefinidas para trar las operaciones u movimiento de dinero que se efectÃÂºan sobre el sistema, las cuales son registradas en la base de datos para luego poder ofrecer los resultado que se requiera como ser el saldo de un cliente, el egreso de dinero fuera del cirtuito normal de compras. Estas transacciones solo se pueden agregar detalles de cÃÂ¡lculo, por ejemplo quiero que los movimientos de pago tengan el detalle del IVA que llevan de esta manera el pago se guarda almacenando el detalle del movimiento calculado a partir de los cÃÂ¡lculos provistos por el usuario del sistema.\u003c/p\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hptipomovimientos.jpg\\\"\u003e\u003cp\u003e\u003cdiv id=\\\"__zsc_once\\\"\u003e\u003c/div\u003e\u003c/p\u003e'),(31,'formulaimportes','index','\u003ch2\u003eCalculos sobre importe\u003c/h2\u003ePermite administrar los calculos sobre los importes que se cargan en el sistema. Se puede agregar nuevos cÃÂ¡culos, como eliminarlos(solo si no se encuentran asociados a algÃÂºn calculo en la DB) u actualizarlos.\u003cbr\u003e\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpformulaimportes.jpg\\\"\u003e\u003cp\u003e\u003c/p\u003e\u003cp\u003e\u003cdiv id=\\\"__zsc_once\\\"\u003e\u003c/div\u003e\u003c/p\u003e\u003cp\u003e\u003c/p\u003e'),(32,'sysconfigs','add','\u003ch2\u003eConfiguraciÃÂ³n Global\u003c/h2\u003e\u003cp\u003ePermite configurar los parametros globales para el sistema.\u003c/p\u003e\u003cul\u003e\u003cli\u003e\u003cb\u003eStock Restricto:\u003c/b\u003e si se encuentra marcado en si no se pueden realizar operaciones con stock negativo.\u003c/li\u003e\u003cli\u003e\u003cb\u003eMercado Pago Token:\u003c/b\u003e permite realizar las ventas y registraciÃÂ³n con mercadolibre.\u003c/li\u003e\u003cli\u003e\u003cb\u003eMercado Libre Usuario:\u003c/b\u003e el usuario de la empresa en mercadolibre.\u003c/li\u003e\u003cli\u003e\u003cb\u003eTransport:\u003c/b\u003e forma de envÃÂ­o de correo por lo general smtp\u003c/li\u003e\u003cli\u003e\u003cb\u003eEmail de:\u003c/b\u003e el correo electrÃÂ³nico que utilizamos actualmente u el que querramos asignarle para el envÃÂ­o de correos.\u003c/li\u003e\u003cli\u003e\u003cb\u003eEmail Host: \u003c/b\u003eel servidor de correo que utilizaremos.\u003c/li\u003e\u003cli\u003e\u003cb\u003ePuerto:\u003c/b\u003e es el puerto de salida del correo para google es el 465.\u003c/li\u003e\u003cli\u003e\u003cb\u003eUser-Email:\u003c/b\u003e el email con el cual accedemos a nuestra cuenta de correo.\u003c/li\u003e\u003cli\u003e\u003cb\u003eContraseÃÂ±a:\u003c/b\u003e la constreÃÂ±a del correo electrÃÂ³nico.\u003c/li\u003e\u003c/ul\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpsysconfig.jpg\\\"\u003e\u003cp\u003e\u003cdiv id=\\\"__zsc_once\\\"\u003e\u003c/div\u003e\u003c/p\u003e'),(33,'buttonusers','index','\u003ch2\u003eBotones de Usuario\u003c/h2\u003e\u003cp\u003eSe visualizan los botones u accesos directos que se visualizaran en la pantalla principal. Desde esta opciÃÂ³n el usuario puede activar u desactivar los botones que se visualizan en la pantalla inicial.\u003c/p\u003ePara agregar los botones si no estuviesen asignado seleccionamos el botÃÂ³n \u003cb\u003eAsignar \u003c/b\u003eesta opciÃÂ³n solo es necesaria para asociar nuevos botones al inicio una vez asignados directamente accedemos\u003cb\u003e \u003c/b\u003ea las funciones desde la pantalla principal.\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hbbuttonusers.jpg\\\"\u003e\u003cp\u003e\u003c/p\u003e\u003cp\u003e\u003cdiv id=\\\"__zsc_once\\\"\u003e\u003c/div\u003e\u003c/p\u003e\u003cp\u003e\u003c/p\u003e'),(34,'buttonusers','edit','\u003ch2\u003eEditar Botones\u003c/h2\u003e\u003cp\u003ePermite activar u desactivar la visualizaciÃÂ³n del botÃÂ³n en la pantalla principal.\u003c/p\u003e\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpbuttonsedit.jpg\\\"\u003e\u003cbr\u003e\u003cp\u003e\u003cdiv id=\\\"__zsc_once\\\"\u003e\u003c/div\u003e\u003c/p\u003e'),(35,'buttonusers','add','\u003ch2\u003eBotones Agregar.\u003c/h2\u003e\u003cp\u003eEsta opciÃÂ³n permite asignar nuevos botones para visualizarce en la ventana principal del menÃÂº.\u003c/p\u003e\u003cp\u003e\u003cb\u003eImagen del BotÃÂ³n:\u003c/b\u003e es una muestra de cÃÂ³mo se ve el botÃÂ³n y su funciÃÂ³n.\u003c/p\u003eEl check si lo tildamos habilitamos el botÃÂ³n al ingresar a la ventana principal veremos el nuevo botÃÂ³n asignado.\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpbuttonsadd.jpg\\\"\u003e\u003cp\u003e\u003cdiv id=\\\"__zsc_once\\\"\u003e\u003c/div\u003e\u003c/p\u003e'),(36,'sales','index','\u003ch2\u003eVentas\u003c/h2\u003e\u003cbr\u003ePermite visualizar las ventas generadas en el sistema. Se pueden realizar la bÃÂºsqueda por los filtros siguientes filtros.\u003cbr\u003e\u003cul\u003e\u003cli\u003eRango de fechas (desde-hasta) que es obligatoria para que sea mas ÃÂ³ptima la bÃÂºsqueda de datos.\u003c/li\u003e\u003cli\u003eFiltrado por el tipo de venta, puede ser venta u presupuesto.\u003c/li\u003e\u003cli\u003eFiltrado por el cliente sobre el cual realicemos la venta.\u003c/li\u003e\u003c/ul\u003eCuando realizamos la bÃÂºsqueda si no se encuentran datos se visualizarÃÂ¡ el mensaje advirtiendo que no existen datos para los filtros seleccionados.\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpsales.png\\\"\u003e\u003cbr\u003e\u003cbr\u003eOperaciones Sobre Registros\u003cbr\u003eSobre los registros de ventas recuperados es posible realizar la siguiente operaciones.\u003cbr\u003e\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpventasoperaciones.png\\\"\u003e\u003cbr\u003e\u003cbr\u003eSi hacemos click sobre el Nro Venta podemos ver el detalle de la venta, si requerimos imprimir un ticket hacemos click en el botÃÂ³n Imprimir para generar el PDF del cual podremos realizar la impresiÃÂ³n del ticket.\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpventadetalle.png\\\"\u003e\u003cbr\u003e\u003cbr\u003eSi el la venta no fue pagada podemos marcar en pagado SI desde el drop down el cual nos abrirÃÂ¡ una ventana para realizar el pago con las diversas opciones de pago.\u003cbr\u003eRegistro sin pago realizado podemos modificar el valor haciendo click en el dropwodn seleccionando\u0026nbsp; en pagado en si\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpventaspago.png\\\"\u003e\u003cbr\u003e\u003cbr\u003eSe despliega la ventana de pagos\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpventaspagosventana.png\\\"\u003e\u003cbr\u003e\u003cbr\u003eActualizar datos de registros.\u003cbr\u003e\u003cbr\u003ePara actualizar los datos del registros que queremos modificar borrar haciendo click en las opciones posibles:\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpventasoper.png\\\"\u003e\u003cbr\u003e\u003cbr\u003e\u003cb\u003eModificar:\u003c/b\u003e permite modificar los productos vendidos u agregados solo cuando la venta no fue efectivamente realizada u marcada en si.\u003cbr\u003e\u003cb\u003eBorrar:\u003c/b\u003e solo es posible borrar aquellas ventas que no se hayan confirmado.\u003cbr\u003e\u003cbr\u003e\u003cbr\u003e\u003cbr\u003e\u003cbr\u003e\u003cbr\u003e\u003cbr\u003e\u003cbr\u003e'),(37,'sales','newsale','\u003ch2\u003eNueva Venta\u003c/h2\u003e\u003cp\u003ePermite generar una nueva venta sea presupuesto u venta.\u003c/p\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpsalesnewsale.png\\\"\u003e\u003cbr\u003e\u003cbr\u003ePara determinar si es una venta u presupuesto debemos seleccionar el Tipo de Venta.\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpventastipo.png\\\"\u003e\u003cbr\u003e\u003cbr\u003eSi la venta es para un cliente buscamos y seleccionamos el mismo, el sistema automÃÂ¡ticamente generara un nÃÂºmero de cuenta corriente para el mismo, de manera que el sistema registrarÃÂ¡ automÃÂ¡ticamente las deudas y pagos que realice el cliente a futuro. \u003cbr\u003e\u003cb\u003eNota:\u003c/b\u003e si el cliente posee deuda al seleccionarlo nos mostrarÃÂ¡ la deuda actual.\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpventasclientes.png\\\"\u003e\u003cbr\u003e\u003cbr\u003eProductos Vendidos.\u003cbr\u003e\u003cbr\u003eMuestra una tabla con filas vacÃÂ­as las cuales contendrÃÂ¡n los datos del producto a ser asignados a la venta.\u003cbr\u003eEn el caso de necesitar mas filas hacemos click en Agregar Filas.\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpsalesproductos.png\\\"\u003e\u003cbr\u003e\u003cbr\u003eEs posible asignar un producto poniendo su identificador y realizando \\r\\ntab si existe el producto agregarÃÂ¡ los datos caso contrario muestra un \\r\\nerror informando la inexistencia del producto.\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpventasfila.png\\\"\u003e\u003cbr\u003e\u003cbr\u003eSi deseamos modificar la cantidad simplemente asignamos la cantidad, si el sistema tiene marcado el stock restricto no serÃÂ¡ posible asignar una cantidad mayor al stock mostrando un mensaje informando que la cantidad no existe. Si el stock no es restricto nos permitirÃÂ¡ operar sin controlar la existencia en el stock.\u003cbr\u003eSi queremos eliminar la fila hacemos cick sobre el botÃÂ³n a la derecha de la fila.\u003cbr\u003e\u003cbr\u003eSeleccionar Productos\u003cbr\u003e\u003cbr\u003eNos permite por medio de filtros traer la lista de productos que coinciden con los filtros ingresados.\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpventasproductos.png\\\"\u003e\u003cbr\u003e\u003cbr\u003e\u003cbr\u003eAl ingresar los filtros hacemos click en \u003cb\u003eBuscar\u003c/b\u003e para ver la lista de productos coincidentes.\u003cbr\u003eEl listado nos muestra los datos del producto incluido el stock, si esta activado el stock restricto nos muestra una leyenda sin stock, caso contrario se visualiza un botÃÂ³n con la imagen del carrito si hacemos click sobre el mismo se agregarÃÂ¡ el producto a lista de productos vendidos.\u003cbr\u003e\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpventasproductoslist.png\\\"\u003e\u003cbr\u003e\u003cbr\u003e\u003cbr\u003eImagen del producto si hacemos click sobre la imagen podemos ver el detalle del producto si hubiera sido cargado.\u003cbr\u003e\u003cbr\u003e\u003cimg style=\\\"max-width:890px\\\" src=\\\"/img/help/hpventasproductdetail.png\\\"\u003e\u003cbr\u003e\u003cbr\u003e\u003cbr\u003e\u003cbr\u003e'),(38,'alquileres','index','\u003ch2\u003eAlquileres Ver\u003c/h2\u003e\u003cp\u003ePermite visualizar la lista de alquileres realizado, la pantalla posee una serie de filtros para reducir los datos recuperados, Fecha desde, Fecha Hasta son obligatorios. El cliente es necesario solo si queremos traer los alquileres para un cliente determinado\u003c/p\u003e\u003cbr\u003e\u003cimg src=\\\"/img/help/hpalquileres.png\\\"\u003e\u003cbr\u003e\u003cbr\u003eAgregados los filtros para visualizar los datos hacemos click en \\\"\u003cb\u003eMostrar\u003c/b\u003e\\\" visualizamos la lista de alquileres determinados por los filtros asignados.\u003cbr\u003e\u003cimg src=\\\"/img/help/hpalquilerelist.png\\\"\u003e\u003cbr\u003e\u003cbr\u003eDatos:\u003cbr\u003e\u003cb\u003eCliente:\u003c/b\u003e datos del cliente DNI mas apellido y nombre su hacemos click sobre el link podemos visualizar el detalle del cliente.\u003cbr\u003e\u003cb\u003eDetalle: \u003c/b\u003eDetalle por el cual se realizo el alquiler u cualquier informaciÃÂ³n que pudiera resultar ÃÂºtil.\u003cbr\u003e\u003cb\u003eFecha:\u003c/b\u003e fecha en la cual se realizo el alquileres.\u003cbr\u003e\u003cb\u003eDetalle:\u003c/b\u003e permite visualizar el detalle de todo los productos que se alquilaron, si los productos ya fueron devueltos figura una imagen con un check en verde informando del evento.\u003cbr\u003e\u003cimg src=\\\"/img/help/hpalquileredetail.png\\\"\u003e\u003cbr\u003e\u003cbr\u003e\u003cbr\u003e\u003cbr\u003e'),(39,'alquileres','add','\u003ch2\u003eNuevo Alquiler\u003c/h2\u003e\u003cp\u003ePermite realizar el alta de un nuevo alquiler.\u003c/p\u003e\u003cli\u003eSe debe seleccionar el cliente desde la opciÃÂ³n de selecciÃÂ³n de cliente.\u003c/li\u003e\u003cli\u003eSe debe debe ingresar una u mas filas con los datos de productos a alquilar que pueden se el id de la bicicleta asignada para alquiler, o un valor ingresado manualmente sin identificador asociado.\u003c/li\u003eUna ves ingresado los datos requeridos hacemos click en Confirmar para que se habilite el alquiler. \u003cbr\u003e\u003cbr\u003e\u003cimg src=\\\"/img/help/hpalquilerenuevo.png\\\"\u003e');","/*!40000 ALTER TABLE `helps` ENABLE KEYS */;","UNLOCK TABLES;","","--","-- Table structure for table `localidades`","--","","DROP TABLE IF EXISTS `localidades`;","/*!40101 SET @saved_cs_client     = @@character_set_client */;","/*!40101 SET character_set_client = utf8 */;","CREATE TABLE `localidades` (","  `id` int(11) NOT NULL,","  `nombre` varchar(50) NOT NULL,","  `departamento_id` int(11) DEFAULT NULL,","  PRIMARY KEY (`id`)",") ENGINE=InnoDB DEFAULT CHARSET=latin1;","/*!40101 SET character_set_client = @saved_cs_client */;","","--","-- Dumping data for table `localidades`","--","","LOCK TABLES `localidades` WRITE;","/*!40000 ALTER TABLE `localidades` DISABLE KEYS */;","INSERT INTO `localidades` VALUES (1,'16 DE JULIO',1),(2,'17 DE AGOSTO',2),(3,'20 