"position:relative"><span class="pl-c"><span class="pl-c">/*</span>!40101 SET character_set_client = @saved_cs_client <span class="pl-c">*/</span></span>;</div></div></div><div class="react-code-text react-code-line-contents" style="min-height:auto"><div><div id="LC857" class="react-file-line html-div" data-testid="code-cell" data-line-number="857" style="position:relative">
</div></div></div><div class="react-code-text react-code-line-contents" style="min-height:auto"><div><div id="LC858" class="react-file-line html-div" data-testid="code-cell" data-line-number="858" style="position:relative"><span class="pl-c"><span class="pl-c">--</span></span></div></div></div><div class="react-code-text react-code-line-contents" style="min-height:auto"><div><div id="LC859" class="react-file-line html-div" data-testid="code-cell" data-line-number="859" style="position:relative"><span class="pl-c"><span class="pl-c">--</span> Dumping data for table `helps`</span></div></div></div><div class="react-code-text react-code-line-contents" style="min-height:auto"><div><div id="LC860" class="react-file-line html-div" data-testid="code-cell" data-line-number="860" style="position:relative"><span class="pl-c"><span class="pl-c">--</span></span></div></div></div><div class="react-code-text react-code-line-contents" style="min-height:auto"><div><div id="LC861" class="react-file-line html-div" data-testid="code-cell" data-line-number="861" style="position:relative">
</div></div></div><div class="react-code-text react-code-line-contents" style="min-height:auto"><div><div id="LC862" class="react-file-line html-div" data-testid="code-cell" data-line-number="862" style="position:relative">LOCK TABLES <span class="pl-s"><span class="pl-pds">`</span>helps<span class="pl-pds">`</span></span> WRITE;</div></div></div><div class="react-code-text react-code-line-contents" style="min-height:auto"><div><div id="LC863" class="react-file-line html-div" data-testid="code-cell" data-line-number="863" style="position:relative"><span class="pl-c"><span class="pl-c">/*</span>!40000 ALTER TABLE `helps` DISABLE KEYS <span class="pl-c">*/</span></span>;</div></div></div><div class="react-code-text react-code-line-contents" style="min-height:auto"><div><div id="LC864" class="react-file-line html-div" data-testid="code-cell" data-line-number="864" style="position:relative">INSERT INTO `helps` VALUES (1,&#039;users&#039;,&#039;index&#039;,&#039;&lt;h2&gt;Usuarios/Ver\r\n			&lt;/h2&gt;\r\n			\r\n				Permite ver el listado de todos los usuarios registrados en el \r\nsistema, contiene una serie de filtros para realizar la bÃÂºsqueda de los \r\nmismo.&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpuserindex.jpg\&quot;&gt;&lt;br&gt;&lt;br&gt;Se pueden realizar diversas operaciones sobre cada uno de los registros, haciendo click sobre el botÃÂ³n de la derecha.&lt;br&gt;&lt;b&gt;Modificar:&lt;/b&gt;\r\n permite modificar los datos del usuario y sus datos personales, desde \r\nesta opciÃÂ³n se puede cambiar la foto de perfil y realizar el cambio de \r\nla contraseÃÂ±a.&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpuseracciones.jpg\&quot;&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;Si hacemos click en &lt;b&gt;modificar&lt;/b&gt; datos personales accedemos a la opciÃÂ³n de actualizacion de datos&lt;br&gt;&lt;br&gt;&lt;b&gt;Datos generales:&lt;/b&gt; corresponde a los datos del usuario de sistema.&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpusersedit.jpg\&quot;&gt;&lt;br&gt;&lt;br&gt;&lt;b&gt;Foto del perfil:&lt;/b&gt; se puede cambiar la imagen de perfil la imagen debe ser menor a 1 MB.&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpfotoperfil.jpg\&quot;&gt;&lt;br&gt;&lt;b&gt;Modificar\r\n ContraseÃÂ±a: &lt;/b&gt;permite modificar la contraseÃÂ±a del usuario, la misma debe \r\ncontener letras y nÃÂºmero y estar en el rango de Buena a Fuerte, se \r\nvisualiza la leyenda a medida que la escribimos.&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpusereditpswd.jpg\&quot;&gt;&lt;br&gt;&lt;br&gt;&lt;b&gt;Borrar:&lt;/b&gt; permite realizar el borrado del usuario seleccionado siempre y cuando el mismo no tenga asociado ventas, u bicicletas.&lt;br&gt;&lt;b&gt;Agregar Bicicleta:&lt;/b&gt; permite asociar bicicletas al usuario&lt;br&gt;\r\n				&lt;p&gt;\r\n					&lt;/p&gt;&lt;p&gt;\r\n				&lt;/p&gt;&#039;),(2,&#039;users&#039;,&#039;addcliente&#039;,&#039;&lt;h2&gt;Usuarios/Agregar\r\n			&lt;/h2&gt;\r\n			\r\n				Permite realizar el alta de un nuevo usuario al sistema los usuarios\r\n por defecto son clientes, de esta manera el cliente recive un mail de \r\nconfirmaciÃÂ³n de alta de usuario para poder operar luego en el sistema \r\nsobre las opciones propias del cliente como ver sus bicicletas, ver \r\nhistorial de reparaciones, cambiar sus datos etc.&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpusersdd.jpg\&quot;&gt;&lt;br&gt;&#039;),(3,&#039;tallercitos&#039;,&#039;edit&#039;,&#039;Mi Taller/Ver Datos&lt;br&gt;&lt;br&gt;Permite ver u actualizar los datos del taller, es importante que el domicilio este correctamente ingresado de manera que cuando se requiera servicios de ubicaciÃÂ³n pueda encontrarse con exactitud el domicilio del local.&lt;br&gt;&lt;b&gt;Logo de Taller&lt;/b&gt;: permite seleccionar una imagen para el logo del taller que si visualiza luego en la parte superior izquierda.&lt;br&gt; &lt;b&gt;Shimano Center&lt;/b&gt; &lt;b&gt;Oficial&lt;/b&gt;: Si seleccionamos en si la opciÃÂ³n el cliente cuando accede a la aplicaciÃÂ³n visualiza el cartel de Shimano Service Center Oficial.&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hptallercitosinfo.jpg\&quot;&gt;\r\n 				&lt;p&gt;\r\n 					&lt;/p&gt;&lt;p&gt;\r\n 				&lt;/p&gt;&#039;),(4,&#039;bicicletas&#039;,&#039;index&#039;,&#039;&lt;h2&gt;Bicicletas Agregar&lt;/h2&gt;&lt;p&gt;Permite asociar bicicletas al cliente del sistema.&lt;/p&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hbbicicletasindex.jpg\&quot;&gt;&lt;br&gt;Si hacemos click en agregar podemos agregar una nueva bicicleta. Se puede capturar una foto por medio de una web cam u por medio de un archivo del sistema.&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpbicicletasadd.jpg\&quot;&gt;&lt;br&gt;&lt;br&gt;&#039;),(5,&#039;bicicletareparamos&#039;,&#039;bicicletareparamocalendario&#039;,&#039;&lt;h2&gt;Mi Taller/Ver Calendario\r\n			&lt;/h2&gt;\r\n			\r\n				Permite visualizar el calendario de repaciÃÂ³n de las bicicletas que se encuentran\r\n para mantenimiento, nos muestra una linea de tiempo con color \r\ndependiendo el estado que se encuentren. &lt;br&gt;&lt;b&gt;NOTA:&lt;/b&gt; La fecha desde es la fecha en que ingresa la bicicleta.&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hptallercalendario.jpg\&quot;&gt;\r\n				&#039;),(6,&#039;bicicletareparamos&#039;,&#039;vertotalservicemes&#039;,&#039;&lt;h2&gt;Mi Taller/Ingresos Mensuales\r\n			&lt;/h2&gt;\r\n			\r\n				Permite ver un grÃÂ¡fico con los montos de los ingresos mensuales proveniente de services realizados en el taller. Se debe ingresar el aÃÂ±o que queremos visualizar para traer los resultados por meses del aÃÂ±o.&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpingresosmens.jpg\&quot;&gt;\r\n				&lt;p&gt;\r\n					&lt;/p&gt;&lt;p&gt;\r\n				&lt;/p&gt;&#039;),(7,&#039;bicicletareparamos&#039;,&#039;tiemposreparestimado&#039;,&#039;&lt;h2&gt;Mi Taller/Tiempos Estimados\r\n			&lt;/h2&gt;\r\n			&lt;p&gt;\r\n				Posee una serie de filtros que nos permite buscar por rango de fecha\r\nlas cuales son obligatorias, mas una descripiÃÂ³n que es optativa, al ejecutar la \r\nconsulta haciendo clic en buscar nos muestra los sevice y el tiempo \r\nestimado que llevo realizar los arreglos resultante de los filtros seleccionados.&lt;/p&gt;&lt;b&gt;NOTA: &lt;/b&gt;en (Detalle ReparaciÃÂ³n) podemo escribir cualquier detalle respecto a como cargamos el campo libre en el ingreso de bicicletas.&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hptiempoestimado.jpg\&quot;&gt;\r\n			\r\n			&lt;p&gt;\r\n				&lt;/p&gt;&lt;p&gt;\r\n			&lt;/p&gt;&#039;),(8,&#039;mensajes&#039;,&#039;indexmant&#039;,&#039;&lt;h2&gt;Mi Taller/Mensajes de Mantenimiento\r\n			&lt;/h2&gt;\r\n			\r\n				Esta opciÃÂ³n posee una serie de filtros que nos permite buscar por rango de fecha las mismas son obligatorias mas una descripiÃÂ³n que es optativa, al ejecutar la \r\nconsulta haciendo clic en Mostrar nos devuelve todos los mensajes de \r\nmantenimiento enviados u por enviar, permitiendo realizar operaciones de\r\n borrado u modificar el mensaje cargado.&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpmensajesmant.jpg\&quot;&gt;\r\n			\r\n			&lt;p&gt;\r\n				&lt;/p&gt;&lt;p&gt;\r\n			&lt;/p&gt;&#039;),(9,&#039;bicicletareparamos&#039;,&#039;add&#039;,&#039;&lt;h2&gt;Bicicletas/Nuevo ingreso\r\n			&lt;/h2&gt;\r\n			\r\n				Permite realizar el ingreso de una bicicleta al taller, para realizar el alta son necesarias las siguientes condiciones:&lt;br&gt;Se debe seleccionar un cliente desde la opciÃÂ³n de bÃÂºsqueda al lado del documento.&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpbuscarcliente.jpg\&quot;&gt;Seleccionamos el cliente requerido haciendo clic en la imagen&amp;nbsp;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpagregar.jpg\&quot;&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpselcliente.jpg\&quot;&gt;&lt;br&gt;&lt;br&gt;Seleccionar la bicicleta a reparar, el cliente debe tener asociada la bicicleta.&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpseleccionarbicicleta.jpg\&quot;&gt;&lt;br&gt;&lt;br&gt;Ingresar uno u n gastos.&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hbbicicletasnuevoingreso.jpg\&quot;&gt;&lt;br&gt;&lt;br&gt;En\r\n el caso de quedarnos sin filas haciendo click en el boton (+) se agrega\r\n una nueva fila. Debe ingresar la cantidad y el precio unitario.&lt;br&gt;Marca envia domicilio: determina si la bicicleta debe ser llevada al domicilio del cliente.&lt;br&gt;Para buscar un producto hacemos click en la lupa verde a la izquierda de la grilla la cual nos muestra una ventana con los distintos filtros de bÃÂºqueda para productos permitiendonos buscar para luego agregar el producto que buscamos.&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpseleccionarproducto.jpg\&quot;&gt;&lt;br&gt;Para eliminar una fila de los gastos hacemos click sobre el botÃÂ³n derecho&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpborrar.jpg\&quot;&gt;&lt;br&gt;&lt;br&gt;\r\n			\r\n			&lt;p&gt;\r\n				&lt;/p&gt;&lt;p&gt;\r\n			&lt;/p&gt;&#039;),(10,&#039;bicicletareparamos&#039;,&#039;index&#039;,&#039;&lt;h2&gt;Bicicletas/Ver Ingresos\r\n			&lt;/h2&gt;\r\n			\r\n				Permite ver y realizar operaciones sobre los registros de ingresos \r\nde bicicletas al taller, los filtros nos permiten buscar una bicicleta a\r\n partir de los datos del cliente pueden ser el documento u nombre u \r\napellido, los filtros son opcionales.&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpveringresos.jpg\&quot;&gt;&lt;br&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Acciones:&lt;/b&gt; permite realizar diversas operaciones sobre los registros.&lt;/p&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpmenuingreso.jpg\&quot;&gt;&lt;br&gt;&lt;ul&gt;&lt;li&gt;&lt;b&gt;Borrar:&lt;/b&gt; borra el ingreso del sistema.&lt;/li&gt;&lt;li&gt;&lt;b&gt;Modificar:&lt;/b&gt; permite modificar u agregar nuevos gastos.&lt;/li&gt;&lt;li&gt;&lt;b&gt;Imprimir:&lt;/b&gt;\r\n retorna un PDF con un cÃÂ³digo QR y detalles del arreglo el cual puede \r\nservir para imprimir y pegarlo en la bicicleta de manera que luego al \r\nescanear la etiqueta con un celular nos lleva a los detalle de \r\nreparaciÃÂ³n de la bicicleta.&lt;/li&gt;&lt;/ul&gt;&#039;),(11,&#039;bicicletareparamos&#039;,&#039;tallerlistarbicicletas&#039;,&#039;&lt;h2&gt;Bicicletas/Ver Bicicletas en Taller\r\n			&lt;/h2&gt;\r\n			\r\n				Permite visualizar y modificar el estado de la bicicleta en el \r\ntaller, desde esta opciÃÂ³n podemos cambiar el estado en que se encuentra \r\nla bicicleta en el taller los estado posibles on&lt;br&gt;&lt;ul&gt;&lt;li&gt;&lt;b&gt;Espera:&lt;/b&gt; en espera para ingresar al taller&lt;/li&gt;&lt;li&gt;&lt;b&gt;En Taller:&lt;/b&gt; se encuentra en proceso de reparaciÃÂ³n en el taller.&lt;/li&gt;&lt;li&gt;&lt;b&gt;Confirmar\r\n Cliente:&lt;/b&gt; al seleccionar este estado el sistema despliega una ventana \r\nemergente en la cual podemos enviar un mensaje al cliente para que este \r\nsepa la novedad y puede por medio de sus opciones confirmar el mensaje \r\npara que siga en curso la reparaciÃÂ³n u contactarse con el encargado del \r\ntaller.&lt;/li&gt;&lt;/ul&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpingresostaller.jpg\&quot;&gt;&lt;br&gt;&lt;br&gt;&lt;p&gt;Una\r\n ves enviado el mensaje debemos esperar en confirmar del cliente para \r\npoder seguir operando cuando el mismo confirma la imagen de mensajes \r\ndebe estar en 0 y en verde, si falta confirmar el mensaje aparece la \r\ncantidad de mensajes a confirmar con rojo&lt;/p&gt;&lt;br&gt;Ventana de enviÃÂ³ de mensajes.&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hhmensajeservtec.jpg\&quot;&gt;&lt;br&gt;&lt;b&gt;Arreglo\r\n finalizado: &lt;/b&gt;este estado nos indica que se&lt;b&gt; &lt;/b&gt;finalizo el arreglo de la bicicleta, por lo tanto se encuentra lista \r\npara ser retirada, al seleccionar este estado desaparece de esta opciÃÂ³n el registro y se debe \r\ncontinuar la entrega por otro circuito.&lt;br&gt;&lt;br&gt;&lt;b&gt;Acciones:&lt;/b&gt; se puede modificar el pedido de reparaciÃÂ³n u imprimir para enviar la impresiÃÂ³n un reporte con lo que se debe realizar para enviar esta impresiÃÂ³n al taller de ser necesario.&lt;br&gt;&lt;br&gt;&#039;),(12,&#039;bicicletareparamos&#039;,&#039;bicicletasentrega&#039;,&#039;&lt;h2&gt;Bicicletas/Entregar Bicicleta\r\n			&lt;/h2&gt;\r\n			\r\n				Permite realizar las operaciones de entrega de la bicicleta, podemos\r\n buscar la bicicleta a partir de los datos del cliente como ser \r\ndocumento nombre u apellido los filtros son opcionales.&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpentregabicicleta.jpg\&quot;&gt;&lt;br&gt;&lt;br&gt;Al\r\n marcar el registro como entregado se despliega una ventana para \r\nrealizar el pago del arreglo que consta de opciones de pago \r\nde contado,Credito u tarjeta, una ves que aceptamos el pago el registro \r\nqueda marcado como entregado en \&quot;si\&quot;. Una vez confirmado no serÃÂ¡ posible\r\n volver a realizar el pago,&lt;br&gt;&lt;br&gt;Podemos imprimir un ticker desde la opciÃÂ³n de acciones&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpimprimir.jpg\&quot;&gt;&lt;br&gt;&lt;br&gt;Podemos agregar mensajes de mantenimiento para la bicicleta desde la imagen de sobre de correo, llegado el \r\ndÃÂ­a en que asignamos como fecha de enviÃÂ³, el mensaje se envÃÂ­a automaticamente al mail\r\n del cliente. El mismo tambiÃÂ©n puede operar desde sus opciones y ver el mensaje.&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpmensaje.jpg\&quot;&gt;&lt;br&gt;Al asignar mensajes de mantenimiento se\r\n visualizara la ventana para cargar mensajes de mantenimiento, la fecha \r\nde envÃÂ­o debe ser mayor a la fecha actual, el asunto el motivo del \r\ncontrol y el detalle lo que querramos informar al cliente&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpmensajeservtec.jpg\&quot;&gt;&lt;br&gt;&#039;),(13,&#039;bicicletareparamos&#039;,&#039;mapbicicletaentregaall&#039;,&#039;&lt;h2&gt;Bicicletas/Entregas Vista GPS\r\n			&lt;/h2&gt;\r\n			\r\n				Nos muestra un mapa con los diversos lugares dÃÂ³nde debemos dejar las bicicletas.&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hbentregagps.jpg\&quot;&gt;&lt;br&gt;Si queremos ver los datos del cliente hacemos click en &lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpdomentrega.jpg\&quot;&gt; para ver en detalles los clientes y el domicilio&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpdomentregalist.jpg\&quot;&gt; &lt;br&gt;Es\r\n posible cambiar las coordenadas de referencia de entrega si desplegamos\r\n Domiclios de Entrega y hacemos click en el ÃÂ­cono de punto GPS &lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpgpspos.jpg\&quot;&gt; se abre una nueva ventana para que podemos referenciar las coordenadas exactas de entrega.&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpcambiarcoorentrega.jpg\&quot;&gt;&lt;br&gt;&lt;br&gt;Esta ventana posee en la parte superior los datos del cliente con la ÃÂºltima referencia de Latitud y Longitud asginada.&lt;br&gt;En\r\n el cuadro se puede ingresar manualmente un direcciÃÂ³n en el formato \r\npropuesto al hacer click en el mapa nos ubica en esa regiÃÂ³n u domicilio.&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpcoorautomatica.jpg\&quot;&gt;&lt;br&gt;Ejemplo\r\n agregamos los datos y hacemos click en el botÃÂ³n para situarnos en ese \r\nlugar del planeta, si hacemos click veremos que aparece una marca y \r\ncambian las coordenadas si cambiamos esta y hacemos click la nueva \r\ncoordenada serÃÂ¡ guardada.&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpbusquedacoord.jpg\&quot;&gt;&lt;br&gt;AsignaciÃÂ³n de coordenada al hacer click sobre el mapa se agrega un indicador dÃÂ³nde realizamos click con el mouse y se actualizan las coordenadas visualizadas en la pantalla como Latitud y Longitud:&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpcoormapa.jpg\&quot;&gt; \r\n			&#039;),(14,&#039;clientes&#039;,&#039;clientedeuda&#039;,&#039;&lt;h2&gt;Movimientos/Cliente Deuda&lt;/h2&gt;&lt;p&gt;Nos permite visualizar las deudas de los clientes, podemos realizar el filtrado por los datos del cliente u traer todos los clientes con sus respectiva deuda.&lt;/p&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpclientedeuda.jpg\&quot;&gt;&#039;),(15,&#039;movimientos&#039;,&#039;veringresosfecha&#039;,&#039;&lt;h2&gt;Movimientos/Movimiento por Fecha.&lt;/h2&gt;Permite visualizar los movimientos realizados en el sistema. &lt;br&gt;Entre los filtros es oblogatoria la fecha desde y hasta.&amp;nbsp; &lt;br&gt;El tipo de movimiento que pueden ser todos. &lt;br&gt;&lt;li&gt;Podemos ver todos los movimientos realizados para un cliente en particular.&lt;/li&gt;&lt;p&gt;&lt;b&gt;NOTA:&lt;/b&gt; antes del listado general se visualiza los diversos tipos de movimientos y sus totales repectivo.&lt;/p&gt;&lt;p&gt;&lt;b&gt;NOTA:&lt;/b&gt; entre las acciones se puede eliminar un movimiento es importante tener mucho cuidado con el borrado de lo contrario puede traer problemas en los balances del sistema.&lt;/p&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpmovimientos.jpg\&quot;&gt;&#039;),(16,&#039;movimientos&#039;,&#039;movimientosmanuales&#039;,&#039;&lt;h2&gt;Movimientos/Movimientos Manuales&lt;/h2&gt;Permite realizar transacciones de distinto tipo como ser Egresos Varios, Ingresos Varios etc.&lt;br&gt;Es importante tener mucho cuidado con el uso de movimiento Gral ya que se pueden ingresar movimientos por importes y valores determinados por el usuario, es importante saber lo que se hace de lo contrario requerir mas informaciÃÂ³n.&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpmovimientosmanuales.jpg\&quot;&gt;&lt;br&gt;&lt;br&gt;Para realizar el pago de cuenta corriente selecciona la opciÃÂ³n de &lt;b&gt;Cuenta Corriente&lt;/b&gt;&lt;br&gt;Se debe selecionar el cliente que queremos realizar el pago de Cta Cte y luego agregar el monto que paga.&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpmovimientoctacte.jpg\&quot;&gt;&lt;br&gt;&#039;),(17,&#039;accesorapidos&#039;,&#039;index&#039;,&#039;&lt;h2&gt;Ventana Inicial&lt;/h2&gt;&lt;p&gt;La ventana principal nos muestra una pantalla que contiene en la parte superior un grupo de botones u accesos rÃÂ¡pidos a opciones del sistema que pueden ser requeridas constantemente, estas opciones pueden ser agregadas u sacadas habilitando u deshabilitando las mismas desde la opciÃÂ³n &lt;b&gt;Sistema/Activar Accesos&lt;/b&gt;&lt;/p&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hcbotonesacceso.jpg\&quot;&gt;&lt;p&gt;Luego se presenta una serie de cuadros con informaciÃÂ³n visual respecto a las bicicletas y sus estados en el taller, en esta captura podemos ver que en espera tenemos 0 bicicletas y en Espera ConfirmaciÃÂ³n hay 4 bicicletas.&lt;/p&gt;&lt;ul&gt;&lt;li&gt;&lt;b&gt;En espera:&lt;/b&gt; bicicleta que no ingresaron al taller.&lt;/li&gt;&lt;li&gt;&lt;b&gt;En taller:&lt;/b&gt; bicicletas que se encuentra en taller.&lt;/li&gt;&lt;li&gt;&lt;b&gt;Espera ConfirmaciÃÂ³n:&lt;/b&gt; bicicletas que se le envÃÂ­o un mensaje al cliente y se espera una confirmaciÃÂ³n u se requiere que se contacte el cliente.&lt;/li&gt;&lt;b&gt;Mensajes de Mantenimiento:&lt;/b&gt; mensajes que deben ser enviado en la fecha a los distintos clientes podemos consultarlo y hablar al cliente de ser necesario para recordar la novedad.&lt;br&gt;&lt;/ul&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hpmensajesaccesorapido.jpg\&quot;&gt;Si hacemos click en &lt;b&gt;Ver Detalle &lt;/b&gt;de cualquiera de las cajas veremos informaciÃÂ³n despecto a las bicicletas como se muestra a continuaciÃÂ³n veremos las del combo de &lt;b&gt;Espera ConfirmaciÃÂ³n&lt;/b&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hcesperaconfirmacion.jpg\&quot;&gt;&lt;br&gt;&lt;p&gt;Esta caja nos muestra la fecha de ingreso la bicicleta Marca Modelo si queremos ver mas detalle hacemos click sobre el enlace para ver los detalles de la bicicleta incluida la foto si la tuviera asociada.&lt;/p&gt;&lt;p&gt;Si deseamos modificar algo respecto al pedido hacemos click en la imagen&lt;/p&gt;&lt;p&gt;&lt;img style=\&quot;max-width:890px\&quot;  src=\&quot;/img/help/hcbotonmodificar.jpg\&quot;&gt;&lt;/p&gt;&lt;p&gt;Para asÃÂ­ acceder a la ediciÃÂ³n del ingreso de la bicicleta.&lt;/p&gt;&lt;br&gt;&#039;),(18,&#039;categorias&#039;,&#039;index&#039;,&#039;&lt;h2&gt;Productos Categorias&lt;/h2&gt;Permite visualizar y administrar las diversas categorias y subcategorias para los diversos productos. &lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpcategorias.jpg\&quot;&gt;&lt;br&gt;&lt;br&gt;Si hacemos click sobre el detalle de la categorÃÂ­a podemos ver las subcategorias asociadas.&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpversubcateg.jpg\&quot;&gt;&lt;br&gt;Para administrar la mismas hacemos click en el botÃÂ³n de acciones posibles sobre el registro para las subcategorias solo podemos editar u eliminar solo si no se encuentra asociada a ningÃÂºn producto.&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hbfuncsubcateg.jpg\&quot;&gt;&lt;br&gt;&lt;br&gt;Si hacemos click en el botÃÂ³n de acciones sobre una categoria nos permite modificar, borrar solo si no se encuentra asociada a ningÃÂºn producto u agregar una nueva subcategoria en Agregar Subcategoria.&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hbcategoriaaddsub.jpg\&quot;&gt;&lt;br&gt;&lt;br&gt;Para crear una categoria hacemos click en el boton de la parte inferior Agregar.&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hbcategagrega.jpg\&quot;&gt;&lt;br&gt;&lt;p&gt;&lt;div id=\&quot;__zsc_once\&quot;&gt;&lt;/div&gt;&lt;/p&gt;&#039;),(19,&#039;categorias&#039;,&#039;add&#039;,&#039;&lt;h2&gt;Agregar Categoria.&lt;/h2&gt;&lt;p&gt;Permite realizar el alta de una nueva categoria. Se debe ingresar la categorÃÂ­a y una imagen desde un archivo determinado al seleccionar la imagen se visualiza en el area de color amarillo para no equivocarnos en la imagen cargada.&lt;/p&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpcategoriasadd.jpg\&quot;&gt;&lt;p&gt;&lt;div id=\&quot;__zsc_once\&quot;&gt;&lt;/div&gt;&lt;/p&gt;&#039;),(20,&#039;categorias&#039;,&#039;addsub&#039;,&#039;&lt;h2&gt;Agregar Subcategorias&lt;/h2&gt;&lt;p&gt;Permite agregar una u n subcategorias para la categoria selecionada, es posible asociarle la imagen para la subcategoria desde un archivo desde el PC del usuario.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Si queremos agregar nuevas filas acemos click en&lt;/b&gt; &lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpagregar.jpg\&quot;&gt;&lt;/p&gt;&lt;b&gt;Si queremos eliminar la fila hacemos click en&lt;/b&gt; &lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpborrar.jpg\&quot;&gt;&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpsubcategoria.jpg\&quot;&gt;&lt;p&gt;&lt;div id=\&quot;__zsc_once\&quot;&gt;&lt;/div&gt;&lt;/p&gt;&#039;),(21,&#039;categorias&#039;,&#039;edit&#039;,&#039;&lt;h2&gt;Actualizar Categoria/Subcategoria&lt;/h2&gt;&lt;p&gt;Permite modificar los datos de la &lt;b&gt;categoria/subcategoria&lt;/b&gt; cargados, se puede modificar la descripciÃÂ³n asÃÂ­ como la imagen.&lt;/p&gt;&lt;p&gt;La imagen actual se visualiza a la derecha de la pantalla, si asignamos una nueva imagen esta imagen cambiarÃÂ¡ por la nueva imagen seleccionada.&lt;/p&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hccategoriaedit.jpg\&quot;&gt;&lt;p&gt;&lt;div id=\&quot;__zsc_once\&quot;&gt;&lt;/div&gt;&lt;/p&gt;&#039;),(22,&#039;proveedores&#039;,&#039;index&#039;,&#039;&lt;h2&gt;Proveedores&lt;/h2&gt;&lt;p&gt;Permite visualizar y realizar Alta/Baja u ModificaciÃÂ³n de los proveedores, que luego van ser vinculados a los diversos productos.&lt;/p&gt;&lt;p&gt;Para agregar un nuevo proveedore hacemos click en el botÃÂ³n agregar.&lt;/p&gt;Con el botÃÂ³n de acciones accedemos a las operaciones de modificaciÃÂ³n u borrado del proveedor.&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hcproveedoresindex.jpg\&quot;&gt;&lt;br&gt;&lt;p&gt;&lt;div id=\&quot;__zsc_once\&quot;&gt;&lt;/div&gt;&lt;/p&gt;&#039;),(23,&#039;proveedores&#039;,&#039;add&#039;,&#039;&lt;h2&gt;Agregar Proveedor&lt;/h2&gt;&lt;p&gt;Permite ralizar el alta de un nuevo proveedor. Los datos son todos obligatorios para realizar el alta.&lt;/p&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpproveedoradd.jpg\&quot;&gt;&lt;br&gt;&lt;br&gt;&lt;p&gt;&lt;div id=\&quot;__zsc_once\&quot;&gt;&lt;/div&gt;&lt;/p&gt;&#039;),(24,&#039;products&#039;,&#039;index&#039;,&#039;&lt;h2&gt;Producto&lt;/h2&gt;Permite visualizar la lista de productos cargada. Se posee una serie de filtros optativos para la bÃÂºsqueda del producto.&lt;br&gt;Entre las acciones posibles para el registro del producto se encuentran:&lt;br&gt;&lt;b&gt;Modificar:&lt;/b&gt; permite modificar los datos cargado del producto.&lt;br&gt;&lt;b&gt;Borrar:&lt;/b&gt; permite eliminar el producto solo si el mismo no se encuentra asignado en una venta.&lt;br&gt;&lt;b&gt;Fotos:&lt;/b&gt; podemos asignar una u n fotos para el producto seleccionado.&lt;br&gt;&lt;br&gt;&lt;b&gt;NOTA:&lt;/b&gt; los productos que tienen imagenes cargadas figuran con un pequeÃÂ±o ÃÂ­cono de imagen en la parte izquierda al lado del nombre del producto.&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpproductos.jpg\&quot;&gt;&lt;br&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;div id=\&quot;__zsc_once\&quot;&gt;&lt;/div&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&#039;),(25,&#039;products&#039;,&#039;add&#039;,&#039;&lt;h2&gt;Agregar Producto&lt;/h2&gt;&lt;p&gt;Permite realizar el alta de un nuevo producto.&lt;/p&gt;&lt;p&gt;Nombre de Producto: nombre del producto a dar de alta.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Sintetico:&lt;/b&gt; un nombre sintetico para el producto puede ser una covinaciÃÂ³n de partes del nombre del producto queda a criterio del cliente.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Cod. Barras:&lt;/b&gt; cÃÂ³digo de barras si llegara a tenerlo de lo contrario lo dejamos libre.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Categoria:&lt;/b&gt; la categoria del producto que queremos dar de alta.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Subcategoria:&lt;/b&gt; es opcional no es obligatorio seleccionar la subcategoria.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Detalles del Producto:&lt;/b&gt; es informaciÃÂ³n detalle del producto que es visualizada por el cliente u el usuario que realiza la venta.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Proveedor:&lt;/b&gt; el proveedor del producto, si escribimos una parte del nombre el sistema nos muestra la lista que coinciden con lo que vamos escribiendo.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Precio:&lt;/b&gt; el precio del producto.&lt;/p&gt;&lt;p&gt;&lt;b&gt;CÃÂ³digo Generico: &lt;/b&gt;un cÃÂ³digo que consta de 3 letras y 3 nÃÂºmero queda a opciÃÂ³n del usuario como ingresarlo.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Peso: &lt;/b&gt;el peso en gramos del producto.&lt;/p&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hbproductsadd.jpg\&quot;&gt;&lt;br&gt;&lt;p&gt;&lt;div id=\&quot;__zsc_once\&quot;&gt;&lt;/div&gt;&lt;/p&gt;&#039;),(26,&#039;products&#039;,&#039;actualizapreciomasivo&#039;,&#039;&lt;h2&gt;Actualizar Precios\r\n&lt;/h2&gt;&lt;p&gt;Esta opciÃÂ³n permite actualizar los precios de los productos de forma masiva. Para ello primero debemos seleccionar los filtros, es posible actualizar todos los precios de una sola ves, por lo tanto hay que tener cuidado a la hora de utilizar esta opciÃÂ³n.&lt;/p&gt;&lt;p&gt;Entre los filtros que son optativos tenemos la Categoria y SubcategorÃÂ­a.&lt;/p&gt;&lt;p&gt;El porcentaje de actualizaciÃÂ³n es obligatorio y va desde 1 al 100.&lt;/p&gt;&lt;p&gt;OperaciÃÂ³n: permite determinar si incrementamos u decrementamos el precios.&lt;/p&gt;&lt;p&gt;Una ves asignados los diversos filtros hacemos click en Calcular, el cual nos muestra un listado con los productos a actualizar el precio actual y el nuevo precio con posbilidad de modificar en el caso que queramos redondear el importe.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Act:&lt;/b&gt; determina si se actualizarÃÂ¡ u no el importe del producto.&lt;/p&gt;&lt;b&gt;Ult. Act:&lt;/b&gt; fecha de ÃÂºltima actualizaciÃÂ³n del producto.&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpproductprecio.jpg\&quot;&gt;&lt;p&gt;&lt;div id=\&quot;__zsc_once\&quot;&gt;&lt;/div&gt;&lt;/p&gt;&lt;br&gt;Si no queremos que actualize un determinado producto con destildarlo de la lista el mismo no serÃÂ¡ tenido en cuenta al actualizar.&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hbproductspreciono.jpg\&quot;&gt;&lt;br&gt;&lt;br&gt;Una ves que chequemos los productos y determinamos si todo esta correcto solo debemos hacer click en el botÃÂ³n que aparece en la parte inferior del listado para que se ejecute el proceso de actualizaciÃÂ³n, finalizado el mismo nos mostrara un listado con los productos actualizados.&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpproductsactprec.jpg\&quot;&gt;&lt;br&gt;&lt;br&gt;Resultado de ejecuciÃÂ³n&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpproductprecsincam.jpg\&quot;&gt;&lt;br&gt;&lt;br&gt;&#039;),(27,&#039;mensajes&#039;,&#039;index&#039;,&#039;&lt;h2&gt;Mensajes&lt;/h2&gt;&lt;p&gt;Permite visualizar la trazabilidad completa de todos los mensajes que se enviaron en el sistema.&lt;/p&gt;&lt;p&gt;Se puede realizar la busqueda de las personas que enviamos mensajes u la fecha en la que se enviaron.&lt;/p&gt;&lt;p&gt;En los resultados podemos ver:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;&lt;b&gt;Creado:&lt;/b&gt; fecha de creaciÃÂ³n del mensaje.&lt;/li&gt;&lt;li&gt;&lt;b&gt;Enviado:&lt;/b&gt; la fecha de enviÃÂ³ efectiva del mensaje.&lt;/li&gt;&lt;li&gt;&lt;b&gt;Fecha Env. Auto:&lt;/b&gt; la fecha en la cual el mensaje se debe enviar de forma automÃÂ¡tica.&lt;/li&gt;&lt;li&gt;&lt;b&gt;Tipo de Mensaje:&lt;/b&gt; el tipo de mensaje, pueden ser de usuario,taller u sistema.&lt;/li&gt;&lt;li&gt;&lt;b&gt;Confirmado:&lt;/b&gt; solo se confirman aquellos mensajes que se enviaron desde el taller.&lt;/li&gt;&lt;/ul&gt;&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpmensajes.jpg\&quot;&gt;&lt;br&gt;&lt;br&gt;Entre las acciones del registro se pueden realizar la siguientes operaciones:&lt;br&gt;&lt;b&gt;Modificar:&lt;/b&gt; modificar el mensaje como ser la fecha de envÃÂ­o el Asunto u el detalle.&lt;br&gt;&lt;b&gt;Eliminar:&lt;/b&gt; permite eliminar el mensaje de la base de datos, cancelando de esta manera el envÃÂ­o del mensaje si es que hubiera tenido activado el enviÃÂ³ automÃÂ¡tico.&lt;br&gt;&lt;b&gt;Enviar Mensaje:&lt;/b&gt; envÃÂ­a el mensaje de forma manual, cuando se realiza el envÃÂ­o se muestra una imagen mientras el proceso se encuentra procesando la solicitud de envÃÂ­o hasta que el mismo es enviado al destinatario.&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpmensajeenvi.jpg\&quot;&gt;&lt;br&gt;&lt;br&gt;Para agregar un mensaje manualmente en el pie de la pÃÂ¡gina se encuentra el botÃÂ³n &lt;b&gt;Nuevo Mensaje&lt;/b&gt;.&lt;br&gt;&lt;p&gt;&lt;div id=\&quot;__zsc_once\&quot;&gt;&lt;/div&gt;&lt;/p&gt;&#039;),(28,&#039;mensajes&#039;,&#039;add&#039;,&#039;&lt;h2&gt;Nuevo Mensaje&lt;/h2&gt;&lt;p&gt;Permite realizar el enviÃÂ³ de mensajes a los distintos clientes del sistema.&lt;/p&gt;&lt;p&gt;Para ello debemos ingresar los datos requeridos.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Fecha EnviÃÂ³ Mensaje:&lt;/b&gt; fecha en que el proceso de envÃÂ­o automÃÂ¡tico realizara el envÃÂ­o.&lt;/p&gt;&lt;p&gt;&lt;b&gt;EnviÃÂ³ AutomÃÂ¡tico:&lt;/b&gt; determina si el proceso debe enviarlo automÃÂ¡ticamente para la fecha de enviÃÂ³.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Tipo de Mensaje:&lt;/b&gt; si es un mensaje de usuario u de cliente.&lt;/p&gt;&lt;b&gt;Sel Cliente:&lt;/b&gt; se debe seleccionar un cliente registrado en el sistema.&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpmensajesadd.jpg\&quot;&gt;&lt;p&gt;&lt;div id=\&quot;__zsc_once\&quot;&gt;&lt;/div&gt;&lt;/p&gt;&#039;),(29,&#039;senderlogs&#039;,&#039;index&#039;,&#039;&lt;h2&gt;Log de Envios de Correos&lt;/h2&gt;&lt;p&gt;Permite ver los log de enviÃÂ³s de correo, permite filtrar los mensajes por rango de fecha, el listado nos muestra los datos del correo y el resultado de la operaciÃÂ³n de enviÃÂ³.&lt;/p&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpsenderlogs.jpg\&quot;&gt;&lt;p&gt;&lt;div id=\&quot;__zsc_once\&quot;&gt;&lt;/div&gt;&lt;/p&gt;&#039;),(30,&#039;tipomovimientos&#039;,&#039;indexusr&#039;,&#039;&lt;h2&gt;Transacciones del Sistema&lt;/h2&gt;&lt;p&gt;El sistema cuenta con un grupo de transacciones predefinidas para trar las operaciones u movimiento de dinero que se efectÃÂºan sobre el sistema, las cuales son registradas en la base de datos para luego poder ofrecer los resultado que se requiera como ser el saldo de un cliente, el egreso de dinero fuera del cirtuito normal de compras. Estas transacciones solo se pueden agregar detalles de cÃÂ¡lculo, por ejemplo quiero que los movimientos de pago tengan el detalle del IVA que llevan de esta manera el pago se guarda almacenando el detalle del movimiento calculado a partir de los cÃÂ¡lculos provistos por el usuario del sistema.&lt;/p&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hptipomovimientos.jpg\&quot;&gt;&lt;p&gt;&lt;div id=\&quot;__zsc_once\&quot;&gt;&lt;/div&gt;&lt;/p&gt;&#039;),(31,&#039;formulaimportes&#039;,&#039;index&#039;,&#039;&lt;h2&gt;Calculos sobre importe&lt;/h2&gt;Permite administrar los calculos sobre los importes que se cargan en el sistema. Se puede agregar nuevos cÃÂ¡culos, como eliminarlos(solo si no se encuentran asociados a algÃÂºn calculo en la DB) u actualizarlos.&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpformulaimportes.jpg\&quot;&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;div id=\&quot;__zsc_once\&quot;&gt;&lt;/div&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&#039;),(32,&#039;sysconfigs&#039;,&#039;add&#039;,&#039;&lt;h2&gt;ConfiguraciÃÂ³n Global&lt;/h2&gt;&lt;p&gt;Permite configurar los parametros globales para el sistema.&lt;/p&gt;&lt;ul&gt;&lt;li&gt;&lt;b&gt;Stock Restricto:&lt;/b&gt; si se encuentra marcado en si no se pueden realizar operaciones con stock negativo.&lt;/li&gt;&lt;li&gt;&lt;b&gt;Mercado Pago Token:&lt;/b&gt; permite realizar las ventas y registraciÃÂ³n con mercadolibre.&lt;/li&gt;&lt;li&gt;&lt;b&gt;Mercado Libre Usuario:&lt;/b&gt; el usuario de la empresa en mercadolibre.&lt;/li&gt;&lt;li&gt;&lt;b&gt;Transport:&lt;/b&gt; forma de envÃÂ­o de correo por lo general smtp&lt;/li&gt;&lt;li&gt;&lt;b&gt;Email de:&lt;/b&gt; el correo electrÃÂ³nico que utilizamos actualmente u el que querramos asignarle para el envÃÂ­o de correos.&lt;/li&gt;&lt;li&gt;&lt;b&gt;Email Host: &lt;/b&gt;el servidor de correo que utilizaremos.&lt;/li&gt;&lt;li&gt;&lt;b&gt;Puerto:&lt;/b&gt; es el puerto de salida del correo para google es el 465.&lt;/li&gt;&lt;li&gt;&lt;b&gt;User-Email:&lt;/b&gt; el email con el cual accedemos a nuestra cuenta de correo.&lt;/li&gt;&lt;li&gt;&lt;b&gt;ContraseÃÂ±a:&lt;/b&gt; la constreÃÂ±a del correo electrÃÂ³nico.&lt;/li&gt;&lt;/ul&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpsysconfig.jpg\&quot;&gt;&lt;p&gt;&lt;div id=\&quot;__zsc_once\&quot;&gt;&lt;/div&gt;&lt;/p&gt;&#039;),(33,&#039;buttonusers&#039;,&#039;index&#039;,&#039;&lt;h2&gt;Botones de Usuario&lt;/h2&gt;&lt;p&gt;Se visualizan los botones u accesos directos que se visualizaran en la pantalla principal. Desde esta opciÃÂ³n el usuario puede activar u desactivar los botones que se visualizan en la pantalla inicial.&lt;/p&gt;Para agregar los botones si no estuviesen asignado seleccionamos el botÃÂ³n &lt;b&gt;Asignar &lt;/b&gt;esta opciÃÂ³n solo es necesaria para asociar nuevos botones al inicio una vez asignados directamente accedemos&lt;b&gt; &lt;/b&gt;a las funciones desde la pantalla principal.&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hbbuttonusers.jpg\&quot;&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;div id=\&quot;__zsc_once\&quot;&gt;&lt;/div&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&#039;),(34,&#039;buttonusers&#039;,&#039;edit&#039;,&#039;&lt;h2&gt;Editar Botones&lt;/h2&gt;&lt;p&gt;Permite activar u desactivar la visualizaciÃÂ³n del botÃÂ³n en la pantalla principal.&lt;/p&gt;&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpbuttonsedit.jpg\&quot;&gt;&lt;br&gt;&lt;p&gt;&lt;div id=\&quot;__zsc_once\&quot;&gt;&lt;/div&gt;&lt;/p&gt;&#039;),(35,&#039;buttonusers&#039;,&#039;add&#039;,&#039;&lt;h2&gt;Botones Agregar.&lt;/h2&gt;&lt;p&gt;Esta opciÃÂ³n permite asignar nuevos botones para visualizarce en la ventana principal del menÃÂº.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Imagen del BotÃÂ³n:&lt;/b&gt; es una muestra de cÃÂ³mo se ve el botÃÂ³n y su funciÃÂ³n.&lt;/p&gt;El check si lo tildamos habilitamos el botÃÂ³n al ingresar a la ventana principal veremos el nuevo botÃÂ³n asignado.&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpbuttonsadd.jpg\&quot;&gt;&lt;p&gt;&lt;div id=\&quot;__zsc_once\&quot;&gt;&lt;/div&gt;&lt;/p&gt;&#039;),(36,&#039;sales&#039;,&#039;index&#039;,&#039;&lt;h2&gt;Ventas&lt;/h2&gt;&lt;br&gt;Permite visualizar las ventas generadas en el sistema. Se pueden realizar la bÃÂºsqueda por los filtros siguientes filtros.&lt;br&gt;&lt;ul&gt;&lt;li&gt;Rango de fechas (desde-hasta) que es obligatoria para que sea mas ÃÂ³ptima la bÃÂºsqueda de datos.&lt;/li&gt;&lt;li&gt;Filtrado por el tipo de venta, puede ser venta u presupuesto.&lt;/li&gt;&lt;li&gt;Filtrado por el cliente sobre el cual realicemos la venta.&lt;/li&gt;&lt;/ul&gt;Cuando realizamos la bÃÂºsqueda si no se encuentran datos se visualizarÃÂ¡ el mensaje advirtiendo que no existen datos para los filtros seleccionados.&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpsales.png\&quot;&gt;&lt;br&gt;&lt;br&gt;Operaciones Sobre Registros&lt;br&gt;Sobre los registros de ventas recuperados es posible realizar la siguiente operaciones.&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpventasoperaciones.png\&quot;&gt;&lt;br&gt;&lt;br&gt;Si hacemos click sobre el Nro Venta podemos ver el detalle de la venta, si requerimos imprimir un ticket hacemos click en el botÃÂ³n Imprimir para generar el PDF del cual podremos realizar la impresiÃÂ³n del ticket.&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpventadetalle.png\&quot;&gt;&lt;br&gt;&lt;br&gt;Si el la venta no fue pagada podemos marcar en pagado SI desde el drop down el cual nos abrirÃÂ¡ una ventana para realizar el pago con las diversas opciones de pago.&lt;br&gt;Registro sin pago realizado podemos modificar el valor haciendo click en el dropwodn seleccionando&amp;nbsp; en pagado en si&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpventaspago.png\&quot;&gt;&lt;br&gt;&lt;br&gt;Se despliega la ventana de pagos&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpventaspagosventana.png\&quot;&gt;&lt;br&gt;&lt;br&gt;Actualizar datos de registros.&lt;br&gt;&lt;br&gt;Para actualizar los datos del registros que queremos modificar borrar haciendo click en las opciones posibles:&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpventasoper.png\&quot;&gt;&lt;br&gt;&lt;br&gt;&lt;b&gt;Modificar:&lt;/b&gt; permite modificar los productos vendidos u agregados solo cuando la venta no fue efectivamente realizada u marcada en si.&lt;br&gt;&lt;b&gt;Borrar:&lt;/b&gt; solo es posible borrar aquellas ventas que no se hayan confirmado.&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;&#039;),(37,&#039;sales&#039;,&#039;newsale&#039;,&#039;&lt;h2&gt;Nueva Venta&lt;/h2&gt;&lt;p&gt;Permite generar una nueva venta sea presupuesto u venta.&lt;/p&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpsalesnewsale.png\&quot;&gt;&lt;br&gt;&lt;br&gt;Para determinar si es una venta u presupuesto debemos seleccionar el Tipo de Venta.&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpventastipo.png\&quot;&gt;&lt;br&gt;&lt;br&gt;Si la venta es para un cliente buscamos y seleccionamos el mismo, el sistema automÃÂ¡ticamente generara un nÃÂºmero de cuenta corriente para el mismo, de manera que el sistema registrarÃÂ¡ automÃÂ¡ticamente las deudas y pagos que realice el cliente a futuro. &lt;br&gt;&lt;b&gt;Nota:&lt;/b&gt; si el cliente posee deuda al seleccionarlo nos mostrarÃÂ¡ la deuda actual.&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpventasclientes.png\&quot;&gt;&lt;br&gt;&lt;br&gt;Productos Vendidos.&lt;br&gt;&lt;br&gt;Muestra una tabla con filas vacÃÂ­as las cuales contendrÃÂ¡n los datos del producto a ser asignados a la venta.&lt;br&gt;En el caso de necesitar mas filas hacemos click en Agregar Filas.&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpsalesproductos.png\&quot;&gt;&lt;br&gt;&lt;br&gt;Es posible asignar un producto poniendo su identificador y realizando \r\ntab si existe el producto agregarÃÂ¡ los datos caso contrario muestra un \r\nerror informando la inexistencia del producto.&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpventasfila.png\&quot;&gt;&lt;br&gt;&lt;br&gt;Si deseamos modificar la cantidad simplemente asignamos la cantidad, si el sistema tiene marcado el stock restricto no serÃÂ¡ posible asignar una cantidad mayor al stock mostrando un mensaje informando que la cantidad no existe. Si el stock no es restricto nos permitirÃÂ¡ operar sin controlar la existencia en el stock.&lt;br&gt;Si queremos eliminar la fila hacemos cick sobre el botÃÂ³n a la derecha de la fila.&lt;br&gt;&lt;br&gt;Seleccionar Productos&lt;br&gt;&lt;br&gt;Nos permite por medio de filtros traer la lista de productos que coinciden con los filtros ingresados.&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpventasproductos.png\&quot;&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;Al ingresar los filtros hacemos click en &lt;b&gt;Buscar&lt;/b&gt; para ver la lista de productos coincidentes.&lt;br&gt;El listado nos muestra los datos del producto incluido el stock, si esta activado el stock restricto nos muestra una leyenda sin stock, caso contrario se visualiza un botÃÂ³n con la imagen del carrito si hacemos click sobre el mismo se agregarÃÂ¡ el producto a lista de productos vendidos.&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpventasproductoslist.png\&quot;&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;Imagen del producto si hacemos click sobre la imagen podemos ver el detalle del producto si hubiera sido cargado.&lt;br&gt;&lt;br&gt;&lt;img style=\&quot;max-width:890px\&quot; src=\&quot;/img/help/hpventasproductdetail.png\&quot;&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;&#039;),(38,&#039;alquileres&#039;,&#039;index&#039;,&#039;&lt;h2&gt;Alquileres Ver&lt;/h2&gt;&lt;p&gt;Permite visualizar la lista de alquileres realizado, la pantalla posee una serie de filtros para reducir los datos recuperados, Fecha desde, Fecha Hasta son obligatorios. El cliente es necesario solo si queremos traer los alquileres para un cliente determinado&lt;/p&gt;&lt;br&gt;&lt;img src=\&quot;/img/help/hpalquileres.png\&quot;&gt;&lt;br&gt;&lt;br&gt;Agregados los filtros para visualizar los datos hacemos click en \&quot;&lt;b&gt;Mostrar&lt;/b&gt;\&quot; visualizamos la lista de alquileres determinados por los filtros asignados.&lt;br&gt;&lt;img src=\&quot;/img/help/hpalquilerelist.png\&quot;&gt;&lt;br&gt;&lt;br&gt;Datos:&lt;br&gt;&lt;b&gt;Cliente:&lt;/b&gt; datos del cliente DNI mas apellido y nombre su hacemos click sobre el link podemos visualizar el detalle del cliente.&lt;br&gt;&lt;b&gt;Detalle: &lt;/b&gt;Detalle por el cual se realizo el alquiler u cualquier informaciÃÂ³n que pudiera resultar ÃÂºtil.&lt;br&gt;&lt;b&gt;Fecha:&lt;/b&gt; fecha en la cual se realizo el alquileres.&lt;br&gt;&lt;b&gt;Detalle:&lt;/b&gt; permite visualizar el detalle de todo los productos que se alquilaron, si los productos ya fueron devueltos figura una imagen con un check en verde informando del evento.&lt;br&gt;&lt;img src=\&quot;/img/help/hpalquileredetail.png\&quot;&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;&#039;),(39,&#039;alquileres&#039;,&#039;add&#039;,&#039;&lt;h2&gt;Nuevo Alquiler&lt;/h2&gt;&lt;p&gt;Permite realizar el alta de un nuevo alquiler.&lt;/p&gt;&lt;li&gt;Se debe seleccionar el cliente desde la opciÃÂ³n de selecciÃÂ³n de cliente.&lt;/li&gt;&lt;li&gt;Se debe debe ingresar una u mas filas con los datos de productos a alquilar que pueden se el id de la bicicleta asignada para alquiler, o un valor ingresado manualmente sin identificador asociado.&lt;/li&gt;Una ves ingresado los datos requeridos hacemos click en Confirmar para que se habilite el alquiler. &lt;br&gt;&lt;br&gt;&lt;img src=\&quot;/img/help/hpalquilerenuevo.png\&quot;&gt;&#039;);</div></div></div><div class="react-code-text react-code-line-contents" style="min-height:auto"><div><div id="LC865" class="react-file-line html-div" data-testid="code-cell" data-line-number="865" style="position:relative"><span class="pl-c"><span class="pl-c">/*</span>!40000 ALTER TABLE `helps` ENABLE KEYS <span class="pl-c">*/</span></span>;</div></div></div><div class="react-code-text react-code-line-contents" style="min-height:auto"><div><div id="LC866" class="react-file-line html-div" data-testid="code-cell" data-line-number="866" style="position:relative">UNLOCK TABLES;</div></div></div><div class="react-code-text react-code-line-contents" style="min-height:auto"><div><div id="LC867" class="react-file-line html-div" data-testid="code-cell" data-line-number="867" style="position:relative">
